INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('11660', '7828', 'it', '0', '', 'Questi dati sono utilizzati per fornire un generale miglioramento a WordPress, che include un aiuto a proteggere il tuo sito trovando ed installando automaticamente nuovi aggiornamenti. Viene anche utilizzato per calcolare statistiche, come ad esempio quelle visualizzate nella <a href="%s">pagina di statistiche di WordPress.org</a>.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('11661', '7829', 'it', '0', '', 'Questa bozza deriva dalle tue <a href="%s">modifiche alla personalizzazione non ancora pubblicate</a>. Puoi modificarla, ma non vi è necessità di pubblicarla ora. Verrà pubblicata automaticamente con queste modifiche.', '0', '', '0', '2018-06-20 09:52:05');
