INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('11667', '7835', 'it', '0', '', 'Questa è una pagina di esempio. Differisce da un articolo del blog perché rimane in posizione fissa e appare nella navigazione del sito (nella maggior parte dei temi). Molte persone iniziano con una pagina informativa che li introduce ai potenziali visitatori. Che potrebbe dire una cosa del genere:\n\n<blockquote>Salve! Sono un pony express di giorno, un aspirante attore di notte e questo è il mio blog. Vivo a Los Angeles, ho un bellissimo cane di nome Jack e adoro la pi&#241;a colada. (E trovarmi sotto la pioggia.)</blockquote>\n\n...oppure qualche cosa del genere:\n\n<blockquote>La XYZ Doohickey Company è stata fondata nel 1971 e da allora ha venduto cazzabubbole di qualità ai propri clienti. Si trova a Gotham City, XYZ impiega oltre 2.000 persone e produce le cose più incredibili per la comunità di Gotham.</blockquote>\n\nCome nuovo utente WordPress, è possibile andare <a href="%s">sulla bacheca</a> per eliminare questa pagina e creare nuove pagine per i propri contenuti. Buon divertimento!', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('11668', '7836', 'it', '0', '', 'Questo non è solo un plugin ma simbolizza la speranza e l\'entusiasmo di una intera generazione riassunti in due parole nella più famosa canzone di Louis Armstrong: Hello, Dolly. Quando viene attivato, si vedranno, alto a destra di ogni pagina di amministrazione, dei versi casuali della canzone <cite>Hello, Dolly</cite>.', '0', '', '0', '2018-06-20 09:52:05');
