INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('11670', '7838', 'it', '0', '', 'Questa versione localizzata contiene sia la traduzione sia altre correzioni alla localizzazione. Puoi saltare l&#8217;aggiornamento se desideri proseguire con la traduzione corrente.', '0', '', '0', '2018-06-20 09:52:05');
