INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('11687', '7854', 'it', '0', '', 'In questa schermata sono elencati i link ai plugin per importare i dati da altre piattaforme di gestione dei contenuti e di blogging. Seleziona la piattaforma dalla quale importare e clicca su "Installa ora" quando richiesto nella finestra pop up. Se la piattaforma non è nell\'elenco, clicca sul link per cercare nella directory dei plugin e verifica se il plugin adatto alla piattaforma è presente.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('11688', '7855', 'it', '0', '', 'Questa schermata permette di accedere a tutti gli articoli. È possibile personalizzare la visualizzazione di questa pagina per soddisfare il proprio flusso di lavoro.', '0', '', '0', '2018-06-20 09:52:05');
