INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('11690', '7857', 'it', '0', '', 'Questa schermata mostra ad un singolo utente tutti i suoi siti del network, permette inoltre a questo utente di impostare il sito principale. Gli utenti possono usare i link posti sotto ciascun sito per visitare il sito oppure la relativa bacheca di amministrazione.', '0', '', '0', '2018-06-20 09:52:05');
