INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('11721', '7888', 'it', '0', '', 'Per permettere l\'uso di questa pagina per riparare automaticamente i problemi del database, aggiungi la seguente linea di codice al tuo file %s. Una volta aggiunta questa linea alla configurazione, ricarica questa pagina.', '0', '', '0', '2018-06-20 09:52:05');
