INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('11727', '7894', 'it', '0', '', 'Per installare il tema così da poterne vedere una anteprima con il contenuto del proprio sito e con la possibilità di personalizzarne le impostazioni fai clic sul pulsante "Installa" in alto a destra del pannello di sinistra. I file del tema verranno scaricati automaticamente sul tuo sito. Una volta terminato il tema sarà ora disponibile per l\'attivazione che potrai effettuare facendo clic sul link "Attiva" oppure navigando alla schermata di Gestione temi e facendo clic sul link  "Anteprima" posto sotto la miniatura di qualsiasi tema installato.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('11728', '7895', 'it', '0', '', 'Per navigare tra le revisioni, <strong>trascina il cursore delle revisioni a destra o a sinistra</strong> oppure <strong>utilizza i pulsanti Precedente o Successivo</strong>.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('11729', '7896', 'it', '0', '', 'Per eseguire l\'azione richiesta, WordPress necessita di alcune informazioni per accedere al server web.', '0', '', '0', '2018-06-20 09:52:05');
