INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('11918', '8085', 'it', '0', '', 'Abbiamo introdotto una nuova libreria per la modifica del codice, CodeMirror, da utilizzare nel core. Utilizzala per migliorare la scrittura o la modifica di qualsiasi codice all\'interno dei tuoi plugin, come ad esempio i campi contenenti CSS o JavaScript.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('11919', '8086', 'it', '0', '', 'Abbiamo apportato molte migliorie alle API JS di Personalizza  in WordPress 4.9, eliminando molti punti deboli e rendendolo semplice come usare le API PHP. Vi sono inoltre dei nuovi template di controllo di base, fra cui un controllo data/ora e delle notifiche per sezione/pannello/globali. <a href="%s">Guarda qui la lista completa.</a>', '0', '', '0', '2018-06-20 09:52:05');
