INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('11929', '8096', 'it', '0', '', 'Benvenuti in WordPress. Prima di iniziare abbiamo bisogno di alcune informazioni sul database. Devi conoscere i seguenti dati prima di procedere.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('11930', '8097', 'it', '0', '', 'Benvenuto in WordPress. Questo è il tuo primo articolo. Modificalo o eliminalo, e inizia a creare il tuo blog!', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('11931', '8098', 'it', '0', '', 'Benvenuto nel migliorato flusso di lavoro dello strumento Personalizza con le bozze di progetto, la protezione del progetto, la programmazione ed i link di anteprima. Ed in più l\'evidenziatore di sintassi e il controllo sugli errori renderanno l\'esperienza di creazione del sito semplice e lineare. E per concludere, se tutto questo non bastasse, abbiamo un nuovo grandioso widget per le Gallerie e miglioramenti nella ricerca e nel cambio dei temi.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('11932', '8099', 'it', '0', '', 'Benvenuto nella famosa installazione di WordPress in cinque minuti! Compila semplicemente le informazioni qua sotto e sarai già sulla strada per utilizzare la piattaforma di pubblicazione più estesa e potente del mondo.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('11933', '8100', 'it', '0', '', 'Benvenuto nella tua Bacheca di WordPress! Questa è la schermata che vedi quando esegui il login al sito e ti permette di accedere a tutte le funzionalità per la gestione di WordPress. Puoi ottenere aiuto per qualsiasi sezione facendo clic sulla scheda Aiuto presente sopra il titolo della schermata.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('11934', '8101', 'it', '0', '', 'Hai avuto dei problemi per i passi necessari a creare un nuovo menu? Ora forse non più! Abbiamo realizzato la nuova interfaccia utente per un processo di creazione dei menu più semplice. Questo nuovo sistema ti guiderà nei vari passaggi.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('11935', '8102', 'it', '0', '', 'Ti sei allontanato dalla tua scrivania prima di aver salvato la nuova bozza del tuo design? Non aver paura, quando tornerai, WordPress 4.9 ti chiederà gentilmente se desideri o meno salvare le tue modifiche non ancora salvate.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('11936', '8103', 'it', '0', '', 'Quale processo decisionale automatizzato e/o profilazione facciamo con i dati dell\'utente', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('11937', '8104', 'it', '0', '', 'Quali procedure abbiamo predisposto per prevenire la violazione dei dati', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('11938', '8105', 'it', '0', '', 'Quali dati personali raccogliamo e perché li raccogliamo', '0', '', '0', '2018-06-20 09:52:05');
