INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('11945', '8112', 'it', '0', '', 'Che ti passa per la testa?', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('11946', '8113', 'it', '0', '', 'Qual è la differenza tra categorie e tag? Normalmente i tag sono parole chiave ad hoc che identificano informazioni importanti negli articoli (nomi, oggetti, etc) che possono essere o non essere ricorrenti negli articoli, mentre le categorie sono sezioni stabilite in anticipo. Pensando al sito come ad un libro, le categorie sono come la tavola dei contenuti e i tag come i termini presenti nell\'indice.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('11947', '8114', 'it', '0', '', 'Quando un commento contiene una di queste parole, nel testo, nel nome, nella URL, nella email o nell\'indirizzo IP, verrà posto nella <a href="edit-comments.php?comment_status=moderated">coda di moderazione</a>. Inserire una singola parola o indirizzo IP per riga. Verranno cercate corrispondenze anche all\'interno delle parole, quindi &#8220;press&#8221;  troverà una corrispondenza in &#8220;WordPress&#8221;.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('11948', '8115', 'it', '0', '', 'Quando un commento contiene una qualsiasi di queste parole, nel testo, nel nome, nella URL, nell\'email o nell\'indirizzo IP, verrà spostato nel cestino. Inserire una singola parola o un indirizzo IP per ciascuna riga. Verranno cercate corrispondenze anche all\'interno delle parole, quindi ad esempio la parola &#8220;press&#8221; troverà una corrispondenza in &#8220;WordPress&#8221;.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('11949', '8116', 'it', '0', '', 'Quando si aggiunge una nuova categoria in questa schermata, si riempiranno i seguenti campi:', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('11950', '8117', 'it', '0', '', 'Quando si aggiunge un nuovo tag in questa schermata, dovrai riempire i seguenti campi:', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('11951', '8118', 'it', '0', '', 'Quando si cambiano i temi vi sono spesso della variazioni sul numero e sulle impostazioni della barre laterali e delle aree widget ed a volte questi conflitti rendono il cambio meno semplice e lineare. Se cambi tema e ti sembra che manchino dei widget, scorri in basso a questa schermata nella sezione Widget inattivi dove sono stati salvati tutti  i widget e le relative impostazioni.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('11952', '8119', 'it', '0', '', 'Quando si visualizza l\'anteprima su un monitor piccolo, è possibile utilizzare l\'icona di riduzione in basso nel pannello di sinistra. Questa permette di nasondere il pannello dando così maggior spazio alla visualizzazione del sito con il nuovo tema. Per riattivare il pannello fare nuovamente clic sull\'icona di riduzione.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('11953', '8120', 'it', '0', '', 'Quando questa impostazione è attiva, una segnalazione appare nel riquadro «In sintesi» della «Bacheca» che dice, «Motori di ricerca scoraggiati», per ricordarti che il tuo sito non è indicizzabile dai motori di ricerca.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('11954', '8121', 'it', '0', '', 'Con le «Azioni di gruppo» è possibile modificare in una sola volta i metadati (categorie, autore, ecc.) di tutti gli articoli selezionati. Per rimuovere un articolo dal gruppo, fare clic sulla x accanto al suo nome nell\'area di Modifica di Gruppo che apparirà.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('11955', '8122', 'it', '0', '', 'Quando i visitatori lasciano commenti sul sito, raccogliamo i dati mostrati nel modulo dei commenti oltre all\'indirizzo IP del visitatore e la stringa dello user agent del browser per facilitare il rilevamento dello spam.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('11956', '8123', 'it', '0', '', 'Quando vengono assegnate più categorie o tag ad un articolo, solo una può essere visualizzata nel permalink: la categoria con l\'ID più basso. Questo si applica se la struttura personalizzata include <code>%category%</code> o <code>%tag%</code>.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('11957', '8124', 'it', '0', '', 'Quando farai clic sul pulsante qui sotto WordPress creerà un file XML da salvare sul tuo computer.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('11958', '8125', 'it', '0', '', 'Quando modifichi direttamente temi o plugin, WordPress 4.9 ti avviserà gentilmente che si tratta di una pratica pericolosa. Ti raccomanderà di effettuare un backup dei tuoi file prima di salvare, così che non vengano sovrascritti dal prossimo aggiornamento. Prendi la via più sicura: il tuo futuro io ti ringrazierà. Il tuo team ed i tuoi clienti ti ringrazieranno.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('11959', '8126', 'it', '0', '', 'Quando effettui l\'accesso, verranno impostati diversi cookie per salvare le tue informazioni di accesso e le tue opzioni di visualizzazione dello schermo. I cookie di accesso durano due giorni mentre i cookie per le opzioni dello schermo durano un anno. Se selezioni &quot;Ricordami&quot;, il tuo accesso persisterà per due settimane. Se esci dal tuo account, i cookie di accesso verranno rimossi.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('11960', '8127', 'it', '0', '', 'Quando pubblichi un nuovo articolo, WordPress lo notifica automaticamente ai seguenti servizi di aggiornamento siti. Per ulteriori informazioni su questa opzione consulta la pagina <a href="https://codex.wordpress.org/Update_Services">Update Services</a> sul Codex. Separa le URL dei vari servizi con un ritorno a capo.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('11961', '8128', 'it', '0', '', 'Quando cambi tema, qualche volta può capitare che i widget non sappiano più dove posizionarsi. I miglioramenti di WordPress 4.9 offrono una maggiore stabilità alle posizioni dei widget e dei menu quando decidi che è giunto il momento di cambiare tema. Inoltre puoi vedere in anteprima i temi installati o scaricare, installare e visualizzare l\'anteprima dei nuovi temi. Nulla è più comodo di poter visualizzare l\'anteprima di quello che si sta per installare. ', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('11962', '8129', 'it', '0', '', 'Dove spediamo i tuoi dati', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('11963', '8130', 'it', '0', '', 'Mentre stai modificando il file %1$s, cogli l\'occasione per verificare che di avere tutte le 8 chiavi e che queste siano univoche. Puoi generarle utilizzando il servizio <a href="%2$s">Secret Key Generator di WordPress.org</a>', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('11964', '8131', 'it', '0', '', 'Mentre il sito viene aggiornato, entrerà in modalità di manutenzione. Non appena gli aggiornamenti saranno completati, tornerà alla normalità.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('11965', '8132', 'it', '0', '', 'Chi siamo', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('11966', '8133', 'it', '0', '', 'Con chi condividiamo i tuoi dati', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('11967', '8134', 'it', '0', '', 'Widget %s', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('11968', '8135', 'it', '0', '', 'I widget sono sezioni indipendenti di contenuto che possono essere posizionati all\'interno di ogni area widgettizzata predisposta nel tema (comunemente identificate come barre laterali). Per aggiungere widget alle barre laterali/aree widgettizzate, drag & drop la barra del titolo del widget nella area desiderata. Di default solo la prima area widgettizata è espansa. Per aggiungere widget alle altre  aree widgettizzate, cliccare sulla loro barra del titolo per espanderle.', '0', '', '0', '2018-06-20 09:52:05');
