INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12032', '8199', 'it', '0', '', 'Stai utilizzando l\'uploader multiplo. Problemi? Prova al suo posto <a href="%1$s" target="%2$s">l\'uploader del browser</a>.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12033', '8200', 'it', '0', '', 'Hai cercato di accedere alla bacheca "%1$s", ma al momento non disponi dei permessi necessari su questo sito. Se pensi che questo sia un errore e che invece dovresti essere in grado di accedere alla bacheca "%1$s", contatta l\'amministratore di rete.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12034', '8201', 'it', '0', '', 'Si sta provando a modificare un allegato che non esiste. Forse è stato cancellato?', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12035', '8202', 'it', '0', '', 'Si sta provando a modificare un elemento che non esiste. Forse è stato cancellato?', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12036', '8203', 'it', '0', '', 'Stai provando a modificare un elemento che non è un allegato. Torna indietro e riprova.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12037', '8204', 'it', '0', '', 'Puoi effettuare la ricerca temi per parole chiave, autore o tag oppure essere maggiormente specifico e ricercare per i criteri elencati nel filtro in evidenza.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12038', '8205', 'it', '0', '', 'Se hai già scaricato un tema in formato ZIP sul tuo computer è possibile Caricarlo manualmente (assicurati che provenga da un sito affidabile e dalla fonte originaria). &Egrave; anche possibile seguire il vecchio sistema utilizzando il protocollo FTP e copiando nella directory %s la cartella del tema scaricato.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12039', '8206', 'it', '0', '', '&Egrave; possibile aggiungere dei link da visualizzare sul sito, di norma utilizzando i  <a href="%s">Widget</a>. Di default, sono inclusi  link ad alcuni siti della comunità di WordPress come esempio.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12040', '8207', 'it', '0', '', '&Egrave; possibile aggiungere o modificare link in questa schermata inserendo le informazioni in ogni casella. Solamente l\'indirizzo web del link e il suo nome (il testo che si desidera venga mostrato come link) sono campi obbligatori.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12041', '8208', 'it', '0', '', 'Puoi anche cercare i plugin preferiti di un utente utilizzando il link Preferiti sopra l\'elenco dei plugin e immettendo il nome utente che ha su WordPress.org.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12042', '8209', 'it', '0', '', 'Puoi anche scegliere un colore di sfondo facendo clic sul pulsante Seleziona colore e quindi inserire un valore HTML esadecimale legittimo, es. &#8220;#ff0000&#8221; per il rosso oppure impostare il colore tramite il selezionatore dei colori.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12043', '8210', 'it', '0', '', 'Puoi anche controllare la visualizzazione del contenuto nei feed RSS  che permettono di indicare il numero massimo di articoli da visualizzare e se mostrare tutto il testo o solo un riassunto.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12044', '8211', 'it', '0', '', 'Puoi creare un articolo anche con il <a href="%s">bookmarklet Press This</a>.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12045', '8212', 'it', '0', '', 'Da questa finestra di dialogo puoi anche eliminare singoli elementi ed accedere alla schermata di modifica estesa.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12046', '8213', 'it', '0', '', 'È inoltre possibile modificare o spostare nel Cestino più articoli per volta. Seleziona gli articoli sui quali desideri apportare delle modifiche utilizzando le caselle di spunta, quindi seleziona l\'azione che desideri eseguire dal menu «Azioni di gruppo» e fai clic su Applica.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12047', '8214', 'it', '0', '', 'Puoi incorporare gli oggetti multimediali da molti siti famosi come Twitter, YouTube, Flickr e altri incollando semplicemente la URL su una riga all\'interno della pagina/articolo. Sul Codex troverai  <a href="https://codex.wordpress.org/Embeds">maggiori informazioni sulle incorporazioni</a> (in inglese).', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12048', '8215', 'it', '0', '', '&Egrave; possibile moderare un commento da questa schermata utilizzando il riquadro di Stato, dove è possibile cambiare la data e l\'ora di un commento.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12049', '8216', 'it', '0', '', '&Egrave; possibile anche eseguire lo stesso tipo di azioni, compresa la riduzione della lista tramite i filtri, agendo su una pagina utilizzando i link delle azioni che appaiono quando si passa sopra ad una riga con il mouse oppure utilizzando il menu Azioni di Gruppo per modificare in una sola volta i metadati di più pagine alla volta.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12050', '8217', 'it', '0', '', '&Egrave; possibile assegnare delle parole chiave agli articoli usando i <strong>tag</strong>. A differenza delle categorie i tag non hanno gerarchia, ovvero non ci sono relazioni tra uno e l&#8217;altro.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12051', '8218', 'it', '0', '', 'Puoi assegnare le posizioni del tema a singoli menu <strong>selezionando le impostazioni opportune</strong> in fondo all\'editor dei menu. Per assegnare in una sola volta i vari menu alle varie posizioni del tema <strong>andare sulla linguetta Gestione posizioni</strong> in cima a questa schermata.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12052', '8219', 'it', '0', '', '&Egrave; possibile modificare la visualizzazione di questa schermata utilizzando l\'etichetta Impostazioni schermata per impostare quanti elementi visualizzare e quante colonne mostrare/nascondere.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12053', '8220', 'it', '0', '', 'Fra le altre cose è possibile cambiare la propria password, attivare le scorciatoie da tastiera, cambiare lo schema colori delle schermate di amministrazione di WordPress e disattivare l\'editor WYSIWYG (Visuale). &Egrave; possibile nascondere la Barra degli strumenti (precedentemente definita come Barra di amministrazione) nel lato pubblico del vostro sito, tuttavia non può essere disattivata nelle schermate di amministrazione.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12054', '8221', 'it', '0', '', 'Puoi cambiare la tua immagine profilo su <a href="%s">Gravatar</a>.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12055', '8222', 'it', '0', '', 'Puoi scegliere fra le immagini per la testata predefinite del tema oppure usarne una di tua scelta. Puoi anche personalizzare come il Titolo e il Motto del sito vengono visualizzati.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12056', '8223', 'it', '0', '', 'È possibile scegliere una delle intestazioni precedentemente caricate o mostrarne una a caso.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12057', '8224', 'it', '0', '', 'È possibile decidere cosa deve essere visualizzato nella pagina principale del sito. Possono essere articoli in ordine cronologico inverso (il classico blog) o una pagina statica/fissa. Per impostare una pagina iniziale statica, per prima cosa è necessario creare due <a href="%s">Pagine</a>. Una diventerà la pagina iniziale, l\'altra sarà quella dove verranno visualizzati gli articoli.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12058', '8225', 'it', '0', '', 'Puoi scegliere se permettere o meno la navigazione del tuo sito da parte dei robot, dei servizi di ping e dagli spider. Se desideri che questi servizi ignorino il tuo sito fai clic sulla casella di spunta accanto a &#8220;Scoraggiare i motori di ricerca dall\'indicizzare questo sito&#8221; e fai clic sul pulsante Salva modifiche alla base della schermata. Si noti che la privacy non è assoluta, il tuo sito è ancora visibile sul web.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12059', '8226', 'it', '0', '', 'È possibile creare gruppi di Link utilizzando Categorie Link. I nomi delle Categorie Link devono essere univoci e le Categorie Link sono separate dalle categorie usate per gli articoli.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12060', '8227', 'it', '0', '', 'Puoi creare il file %s manualmente ed incollare il seguente testo in esso.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12061', '8228', 'it', '0', '', '&Egrave; possibile organizzare la visualizzazione di questa schermata in diversi modi:', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12062', '8229', 'it', '0', '', '&Egrave; possibile personalizzare la visualizzazione di questa schermata utilizzando l\'etichetta impostazione schermo e/o i filtri a discesa sopra la tabella dei link.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12063', '8230', 'it', '0', '', 'È possibile personalizzare la visualizzazione dei contenuti di questa pagina in diversi modi:', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12064', '8231', 'it', '0', '', '&Egrave; possibile personalizzare l\'aspetto del proprio sito senza modificare il codice del tema utilizzando uno sfondo personalizzato. Lo sfondo può essere una immagine o un colore.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12065', '8232', 'it', '0', '', 'Puoi eliminare le categorie dei collegamenti nel menu a discesa «Azioni di gruppo», ma questa azione non elimina i collegamenti appartenenti alla categoria ma semplicemente li sposta sotto la categoria dei collegamenti predefinita.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12066', '8233', 'it', '0', '', 'Puoi modificare l&#8217;immagine e preservarne la miniatura. Ad esempio, potresti volere una miniatura quadrata che mostra solo una parte dell&#8217;immagine.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12067', '8234', 'it', '0', '', '&Egrave; possibile modificare, se necessario, le informazioni lasciate in un commento. Ciò è particolarmente utile quando ci si accorge che un commentatore ha commesso qualche errore tipografico.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12068', '8235', 'it', '0', '', 'Puoi abilitare la modalità di scrittura senza distrazioni utilizzando l\'icona sulla destra. Questa funzionalità non è disponibile per i vecchi browser o per le periferiche con uno schermo piccolo e richiede che l\'editor a tutta altezza sia abilitato nelle Impostazioni schermata.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12069', '8236', 'it', '0', '', '&Egrave; possibile esportare un file del contenuto del proprio sito;per poterlo importare su di un\'altra installazione o su una diversa piattaforma. Il file di esportazione sarà un file in formato XML file denominato WXR. Articoli, pagine, commenti, campi personalizzati, categorie e tag possono venir inseriti in questo file. &Egrave; possibile scegliere per il file WXR file di includere solo determinati articoli o pagine, selezionando i filtri che limitano l\'esportazione per categoria, autore, per mese o per stato di pubblicazione.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12070', '8237', 'it', '0', '', 'Puoi filtrare l\'elenco degli articoli per status dell\'articolo usando i link testuali sopra l\'elenco degli articoli per mostrare esclusivamente gli articoli con quello  status articolo. La visualizzazione predefinita mostra tutti gli articoli.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12071', '8238', 'it', '0', '', 'Puoi filtrare l\'elenco degli utenti per Ruolo utente utilizzando i link di testo sopra l\'elenco degli utenti per visualizzare Tutti,gli Amministratori, gli Editori, gli Autori, i Contribuenti o i Sottoscrittori. Di base la vista mostra tutti gli utenti. I Ruoli non utilizzati non vengono elencati.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12072', '8239', 'it', '0', '', 'Puoi trovare temi aggiuntivi per il tuo sito utilizzando il browser/installatore di Temi presente in questa schermata, che mostrerà i temi presenti nella <a href="%s">Directory dei temi di WordPress.org</a>. Questi temi sono stati progettati e sviluppati da terze parti, sono disponibili gratuitamente, e sono compatibili con la licenza utilizzata da WordPress.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12073', '8240', 'it', '0', '', 'Puoi trovare nuovi plugin da installare cercandoli o sfogliando la directory nella tua sezione Plugin.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12074', '8241', 'it', '0', '', '&Egrave; possibile mostrare/nascondere le colonne e stabilire quanti articoli mostrare per schermata, utilizzando l\'etichetta Impostazione schermo.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12075', '8242', 'it', '0', '', '&Egrave; possibile nascondere/mostrare le colonne a seconda delle proprie necessità e decidere quanti utenti mostrare in ogni schermata tramite la scheda Impostazioni schermata', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12076', '8243', 'it', '0', '', 'Puoi inserire i file media facendo clic sulle icone poste sopra l’editor degli articoli e seguendo le istruzioni. Puoi allineare o modificare le immagini utilizzando la barra degli strumenti in linea disponibile nella modalità visuale.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12077', '8244', 'it', '0', '', 'Puoi disconnetterti da altri dispositivi, come il tuo telefono o un computer pubblico, facendo clic sul pulsante «Esci da tutte le altre sessioni».', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12078', '8245', 'it', '0', '', '&Egrave; possibile gestire i commenti fatti sul tuo sito in modo simile a come si gestiscono articoli e altri contenuti. Questa schermata &egrave; personalizzabile come le altre schermate di gestione ed &egrave; possibile agire sui singoli commenti passandoci sopra con il mouse o usanre le Azioni di Gruppo.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12079', '8246', 'it', '0', '', 'Puoi limitare la lista per tipo/stato del file oppure per data utilizzando il menu a comparsa sopra la tabella degli elementi media.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12080', '8247', 'it', '0', '', 'Puoi gestire e vedere l’anteprima del tuo sfondo modificato in <a href="%1$s">Personalizza</a>.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12081', '8248', 'it', '0', '', 'Ora puoi gestire e vedere l’anteprima live della personalizzazione della testata in <a href="%1$s">Personalizza</a>.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12082', '8249', 'it', '0', '', 'Puoi scalare proporzionalmente l&#8217;immagine originale. Per un migliore risultato, dovresti scalare l&#8217;immagine prima di ritagliarla, capovolgerla o ruotarla. Le immagini possono essere solo rimpiccolite, non ingrandite.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12083', '8250', 'it', '0', '', '&Egrave; possibile organizzare  la lista per visualizzare solo gli articoli di una specifica categoria o di un mese specifico, utilizzando i menu a scomparsa sopra la lista degli articoli. Cliccare sul pulsante filtra dopo aver effettuato la selezione. &Egrave; possibile organizzare la visualizzazione cliccando sull\'autore dell\'articolo. sulla categoria o sui tag nella lista degli articoli.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12084', '8251', 'it', '0', '', 'Puoi selezionare una immagine da visualizzare in cima al tuo sito caricandola dal tuo computer o scegliendola dalla libreria media. Dopo aver selezionato l’immagine potrai ritagliarla.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12085', '8252', 'it', '0', '', 'Puoi selezionare la lingua che preferisci usare per la schermata di amministrazione senza modificare la lingua del sito che il visitatore vede.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12086', '8253', 'it', '0', '', 'Puoi impostare un\'immagine personalizzata per il tuo sito. Basta caricare e ritagliare l\'immagine e la nuova testata andrà online immediatamente. In alternativa puoi utilizzare un\'immagine caricata precedentemente nella Libreria media facendo clic sul pulsante &#8220;Seleziona immagine&#8221;.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12087', '8254', 'it', '0', '', '&Egrave; possibile impostare una dimensione massima delle immagini inserite nei contenuti scritti; è anche possibile inserire immagini ad immagine intera.', '0', '', '0', '2018-06-20 09:52:05');
