INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12089', '8256', 'it', '0', '', '&Egrave; possibile continuare ad utilizzare il sito ma i sottodomini potrebbero essere inaccessibili. Se i DNS sono correttamente configurati, questo messaggio può essere ignorato.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12090', '8257', 'it', '0', '', '&Egrave; possibile inviare i contenuti con vari metodi. Questa schermata contiene le impostazioni per tutte le metodologie disponibili. La sezione iniziale controlla l\'editor disponibile nella bacheca, mentre il resto controlla i metodi di pubblicazione esterni. Per ulteriori informazioni su ciascuno di questi metodi utilizzare i link di documentazione.', '0', '', '0', '2018-06-20 09:52:05');
