INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12094', '8261', 'it', '0', '', '&Egrave; possibile utilizzare le categorie per creare sezioni diverse del sito e gruppi di articoli. La categoria predefinita è &#8220;senza categoria&#8221; fino a che non viene modificata nelle <a href="%s">impostazioni di scrittura.</a>', '0', '', '0', '2018-06-20 09:52:05');
