INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12553', '6058', 'ko', '0', '', '<a href="https://wordpress.org/support/forum/multisite/">지원 포럼</a>', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12554', '6059', 'ko', '0', '', '<code>_blank</code> - 새 창이나 탭.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12555', '6060', 'ko', '0', '', '<code>_none</code> - 같은 창 또는 탭.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12556', '6061', 'ko', '0', '', '<code>_top</code> - 현재 창 또는 탭(노 프레임).', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12557', '6062', 'ko', '0', '', '<span>활성:</span> %s', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12558', '6063', 'ko', '0', '', '<strong>%s</strong> &mdash; 삽입하지 않고 이미지와 글을 연관지을 수 있습니다. 이것은 테마가 홈 페이지와 사용자 정의 헤더와 같은 곳에서  특성 이미지를 글 썸네일로 사용할 수 있게 만들었을 때만 유용합니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12559', '6064', 'ko', '0', '', '<strong><em>비밀번호를 잘 기억해두세요.</em></strong> 이 비밀번호는 <em>임의</em>로 만든 것입니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12560', '6065', 'ko', '0', '', '<strong>활동</strong> &mdash; 예약된 글, 최근에 발행된 글, 글에서 최근에 달린 댓글을 표시하고 검토할 수 있도록 합니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12561', '6066', 'ko', '0', '', '<strong>충고:</strong> 만약 현재 사용하는 테마를 실시간으로 편집하고 있다면 사이트 문제 발생에 대해서 주의하세요.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12562', '6067', 'ko', '0', '', '<strong>전체 보기</strong> &mdash; 사이트의 콘텐츠 요약을 표시하며 사용하는 테마와 워드프레스 버전을 확인할 수 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12563', '6068', 'ko', '0', '', '<strong>박스 제어</strong> &mdash; 박스를 확대하거나 축소하려면 제목 바를 클릭하세요. 플러그인에 의해 추가된 일부 박스는 환경설정할 수 있는 콘텐츠가 있을 수도 있으며 마우스를 올리면 제목 바에 &#8220;환경설정&#8221; 링크가 보입니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12564', '6069', 'ko', '0', '', '편집기에서 <strong>메뉴 아이템의 우측에 있는 화살표를 클릭하면</strong> 표준 설정 그룹을 보여줍니다. 링크 대상, CSS 클래스, 링크 관계, 링크 설명과 같은 추가 설정을 화면 옵션 탭을 통해 활성화 하거나 비활성화 할 수 있습니다. ', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12565', '6070', 'ko', '0', '', '사용중인 워드프레스 버전과 <strong>호환됨</strong>', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12566', '6071', 'ko', '0', '', '<strong>연결이 끊어졌습니다.</strong> 다시 연결될 때까지 저장이 안됩니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12567', '6072', 'ko', '0', '', '<strong>삭제</strong>는 확인을 위해 사용자 삭제 화면으로 이동합니다. 거기서 사이트로부터 사용자를 영구히 제거하고 콘텐츠도 삭세할 수 있습니다. 일괄작업을 이용해 한번에 다수의 사용자를 삭제할 수도 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12568', '6073', 'ko', '0', '', '<strong>설명</strong> &mdash; 설명은 기본적으로는 많이 존재하지는 않지만 일부 테마에서는 보여주기도 합니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12569', '6074', 'ko', '0', '', '<strong>토론</strong> &mdash; 댓글과 핑을 켜고 끌 수 있으며 만약 글에 댓글이 있다면 여기에서 보고 검토할 수 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12570', '6075', 'ko', '0', '', '<strong>끌어놓기</strong> &mdash; 상자들을 재배치하기 위해서 선택한 상자의 제목 표시줄을 클릭하고 원하는 위치에서 회색 점선의 직사각형이 보이는 곳에 상자를 배치하세요.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12571', '6076', 'ko', '0', '', '파일을 아래 영역으로 <strong>끌어놓기</strong>하세요. 여러 개의 파일도 가능합니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12572', '6077', 'ko', '0', '', '<strong>에러:</strong> 서버에 연결하는 중에 에러가 생겼습니다. 설정이 올바른지 확인하십시요.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12573', '6078', 'ko', '0', '', '<strong>에러</strong>: "테이블 접두어"가 유효하지 않습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12574', '6079', 'ko', '0', '', '<strong>에러</strong>: 암호에 "\\" 문자를 포함할 수 없습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12575', '6080', 'ko', '0', '', '<strong>에러</strong>: 별명을 입력해주세요.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12576', '6081', 'ko', '0', '', '<strong>에러</strong>: 비밀번호를 입력하세요.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12577', '6082', 'ko', '0', '', '<strong>에러</strong>: 이메일 주소를 넣으세요.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12578', '6083', 'ko', '0', '', '<strong>에러</strong>: 비밀번호 필드 두 군데에 비밀번호를 똑같이 넣어야 합니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12579', '6084', 'ko', '0', '', '<strong>에러</strong>: 옵션 페이지를 찾지 못했습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12580', '6085', 'ko', '0', '', '<strong>편집</strong>은 해당 사용자의 프로필 편집 화면으로 이동합니다. 사용자명을 클릭해 해당 화면으로 이동할 수도 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12581', '6086', 'ko', '0', '', '<strong>편집</strong>은 그 글에 대해 편집 할 수 있도록 편집 화면으로 이동합니다. 글 제목을 클릭해서 그 화면으로 이동할 수도 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12582', '6087', 'ko', '0', '', '<strong>글 형식</strong> &mdash; 글 형식은 테마가 특정 글을 어떻게 나타낼지 지정합니다. 예를 들면 제목과 문장이 있는 <em>기본</em> 블로그 글이 있는가 하면 제목을 생략하고 짧은 안내문이 있는 <em>추가 정보</em>가 있을 수 있습니다. <a href="https://codex.wordpress.org/Post_Formats#Supported_Formats">글 형식의 설명</a>에 대해서는 코덱스를 참고하세요. 테마에 따라서 10개의 글 형식 모두 또는 몇 개를 사용할 수 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12583', '6088', 'ko', '0', '', '<strong>중요:</strong> 업그레이드 전에 꼭 <a href="https://codex.wordpress.org/WordPress_Backups">데이터베이스와 파일을 백업하세요</a>.업데이트에 도움이 필요하다면,<a href="https://codex.wordpress.org/Updating_WordPress">워드프레스 업데이트</a> 코덱스 페이지를 방문하세요.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12584', '6089', 'ko', '0', '', '사용중인 워드프레스 버전과 <strong>호환되지 않음</strong>', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12585', '6090', 'ko', '0', '', '<strong>정보</strong> &mdash; 사이트 URL을 수정하면 사이트가 제대로 작동하지 않습니다. 등록된 날짜와 최근 업데이트 된 날짜가 표시됩니다. 네트워크 관리자는 사이트를 보관함, 스팸, 삭제됨, 성숙, 공개 목록에서 제거 또는 비활성화 처리할 수 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12586', '6091', 'ko', '0', '', '<strong>이름</strong> &mdash; 사이트에 나타나는 이름', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12587', '6092', 'ko', '0', '', '<strong>정렬</strong> &mdash; 페이지는 기본적으로 알파벳순으로 정렬되지만, 이 필드에 숫자를 입력해서(첫번째는 1, 이런식으로) 자신만의 정렬을 만들 수 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12588', '6093', 'ko', '0', '', '<strong>상위</strong> &mdash; 태그와는 달리 카테고리는 계층구조가 있을 수 있습니다. 재즈 카테고리가 있을 경우 해당 카테고리 아래에 Bebop 과 Big Band와 같은 하위 카테고리가 있을 수 있습니다. 모두 선택적입니다. 하위 카테고리를 생성하려면 상위 드랍다운에서 다른 카테고리를 선택하면 됩니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12589', '6094', 'ko', '0', '', '<strong>상위</strong> &mdash; 페이지들을 계층구조로 정렬할 수 있습니다. 예를 들어 &#8220;라이프 스토리&#8221;와 &#8220;내 강아지&#8221;를 하위 페이지로 가지고 있는 &#8220;나의 소개&#8221; 라는 페이지를 만들 수 있습니다. 페이지를 만드는 깊이에는 제한이 없습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12590', '6095', 'ko', '0', '', '<strong>주의:</strong> 테마에 작업한 모든 사용자 정의는 사라질 것입니다. 수정을 위해 <a href="%s">하위 테마</a>의 사용을 고려해보세요.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12591', '6096', 'ko', '0', '', '<strong>글 편집기</strong> &mdash; 글 작성 시 텍스트를 입력합니다. 두 가지 편집이 있습니다: 비주얼 및 텍스트. 해당 탭을 클릭해서 모드를 선택합니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12592', '6097', 'ko', '0', '', '<strong>미리보기</strong>는 발행했을 때 임시 글이 어떻게 나타나는지 보여줍니다. 보기는 실제 사이트에서 글을 볼 수 있게 이동합니다. 글의 상태에 따라 사용 가능한 링크가 달라집니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12593', '6098', 'ko', '0', '', '<strong>공개하기</strong> &mdash; 공개하기 박스에서 자신의 글을 공개할 수 있는 조건을 설정할 수 있습니다. 상태, 가시성, 공개 (즉시)의 경우 추가 옵션을 보기 위해 편집 링크를 클릭하세요. 가시성은 글의 비밀번호 보호 옵션과 글 목록의 최상단으로 올릴 수 있는 붙박이 기능이 있습니다. 비공개 옵션은 편집자와 관리자를 제외한 모든 사람으로부터 글을 숨길 수 있읍니다. 공개 (즉시)는 미래 또는 과거의 날짜와 시간을 설정할 수 있으며 글을 미래로 예약하거나 과거의 날짜로 변경해 발행할 수 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12594', '6099', 'ko', '0', '', '<strong>빠른 임시글</strong> &mdash; 새 글을 만들 수 있고 임시글로 저장합니다. 또한 최근 임시글 5개의 링크를 표시합니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12595', '6100', 'ko', '0', '', '<strong>빠른 편집</strong>은 이 화면에서 벗어나지 않고 글의 세부사항을 업데이트 할 수 있도록 글의 메타 데이터에 인라인 접근을 제공합니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12596', '6101', 'ko', '0', '', '<strong>랜덤:</string> 각 페이지에 다른 이미지 보여주기.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12597', '6102', 'ko', '0', '', '<strong>제거</strong>는 사이트에서 사용자를 제거합니다. 사용자의 콘텐츠를 제거하지는 않습니다. 일괄작업으로 한번에 다수의 사용자를 제거할 수도 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12598', '6103', 'ko', '0', '', '<strong>화면 옵션</strong> &mdash; 보여줄 알림판 메타박스를 선택하려면 화면 옵션 탭을 사용하세요.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12599', '6104', 'ko', '0', '', '<strong>트랙백 보내기</strong> &mdash; 트랙백은 레거시 블로그 시스템에 글을 링크했음을 알리는 방법입니다. 트랙백을 보내고 싶은 URL을 입력하세요. 만약 다른 워드프레스 사이트를 링크하고 싶다면 핑백을 이용해서 자동으로 알려줄 것입니다.그리고 이 입력란은 필요하지 않습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12600', '6105', 'ko', '0', '', '<strong>설정</strong> &mdash; 이 페이지는 이 사이트와 관련된 모든 설정 목록을 보여줍니다. 일부는 워드프레스에 의해 생성되고 다른 일부는 활성화 한 플러그인에 의해 생성된 것입니다. 일부 필드는 비활성 상태로 일련번호화된 데이터로 표시됩니다. 이 값들은 데이터베이스에 설정이 저장돼 있어서 수정할 수 없습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12601', '6106', 'ko', '0', '', '<strong>슬러그</strong> &mdash; &#8220;슬러그(slug)&#8221; 는 이름의 URL-친화적인 버전이며 모두 소문자로 이루어져 있으며 글자, 숫자와 하이픈으로 이뤄져 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12602', '6107', 'ko', '0', '', '<strong>템플릿</strong> &mdash; 어떤 테마는 추가적인 특성이나 사용자 레이아웃을 위한 특정 페이지에서 사용하는 템플릿을 가지고 있습니다. 이때는 이 드랍다운 메뉴에서 볼 수 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12603', '6108', 'ko', '0', '', '<strong>부모 테마를 찾을 수 없습니다.</strong>. 이 자식 테마를 사용하기 전에 부모테마, %s를 설치해야 합니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12604', '6109', 'ko', '0', '', '<strong>테마와 플러그인</strong> &mdash; 이 화면에서 개별 테마나 플러그인을 업데이트 하려면 선택을 위해 체크박스를 사용하세요. 그런 다음 <strong>적절한 &#8220;업데이트&#8221; 버튼을 클릭하세요</strong>. 한번에 모든 테마나 플러그인을 업데이트 하려면 업데이트 버튼을 클릭하기 전에 모두 선택하기 위해 선택 상단에 있는 체크박스에 체크할 수 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12605', '6110', 'ko', '0', '', '<strong>테마</strong> &mdash; 이 영역은 네트워크 전체에 활성화 되지 않은 테마들을 보여줍니다. 이 메뉴에서 테마를 활성화 하면 이 사이트에서 접근할 수 있습니다. 테마를 활성화 하는 것은 아니지만 사이트의 외모 메뉴에서 나타나도록 할 수 있습니다. 전체 네트워크에 테마를 활성화 하려면 <a href="%s">네트워크 테마</a> 화면으로 가세요.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12606', '6111', 'ko', '0', '', '<strong>제목</strong> &mdash; 글의 제목을 입력하세요. 제목을 입력한 후 본문 입력란에 클릭하면 제목 바로 아래에 고유주소를 볼 수 있으며 이것을 편집할 수 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12607', '6112', 'ko', '0', '', '<strong>번역</strong> &mdash; 워드프레스 번역 파일은 번역이 업데이트 될 때마다 적용됩니다. 하지만 파일이 최신이 아닌 경우 <strong>click the &#8220;번역 업데이트&#8221;</strong> 버튼을 클릭할 수 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12608', '6113', 'ko', '0', '', '<strong>휴지통</strong>은 글을 이 목록에서 제거하여 휴지통에 배치합니다. 거기서 영구적으로 삭제할 수 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12609', '6114', 'ko', '0', '', '<strong>사용자</strong> &mdash; 이곳은 이 사이트에 관련된 사용자를 표시합니다. 사용자의 역할변경, 비밀번호 초기화 또는 사이트에서 제거를 할 수 있습니다. 사이트에서 사용자를 제거하더라도 네트워크에서 제거되는 것은 아닙니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12610', '6115', 'ko', '0', '', '<strong>버전 %1$s</strong>이(가) %2$s 버그를 해결함.', '0', '', '0', '2018-06-20 09:52:10');
