INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12620', '6125', 'ko', '0', '', '<strong>주의:</strong> 이 플러그인은 워드프레스 현재 버전에서 충분히 <strong>시험되지 않았습니다.</strong> ', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12621', '6126', 'ko', '0', '', '<strong>경고:</string> 이 페이지들이 같을 수 없습니다!', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12622', '6127', 'ko', '0', '', '<strong>환영합니다</strong> &mdash; 새 사이트를 만들 때 대표적인 작업중 몇개가 가능한 링크를 보여줍니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12623', '6128', 'ko', '0', '', '<strong>워드프레스 뉴스</strong> &mdash; 워드프레스 공식 프로젝트와 <a href="%s">워드프레스 플래닛</a>으로부터 최근 뉴스.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12624', '6129', 'ko', '0', '', '<strong>워드프레스 뉴스</strong> &mdash; 워드프레스 공식 프로젝트와 <a href="%s">워드프레스 플래닛</a>, 그리고 인기 플러그인으로부터 최근 뉴스.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12625', '6130', 'ko', '0', '', '<strong>워드프레스</strong> &mdash; 워드프레스 설치 업데이트는 간단한 원 클릭 과정입니다: 새 버전이 가능하다는 알림이 있으면 <strong>&#8220;지금 업데이트&#8221; 버튼을 클릭하기만 하면 됩니다</strong>.', '0', '', '0', '2018-06-20 09:52:10');
