INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12773', '6278', 'ko', '0', '', '베타 테스팅?\n =============\n \n 이 디버그 이메일은 워드프레스 개발 버전을 사용할 때 보내집니다.\n \n 이들 실패가 워드프레스의 버그로 인한 것이라고 생각될 경우 보고해주세요.\n * 지원 포럼에서 글 작성하기: https://wordpress.org/support/forum/alphabeta\n * 또는 버그 보고서를 작성하기를 원할 경우: https://core.trac.wordpress.org/\n \n 감사합니다! -- 워드프레스 팀', '0', '', '0', '2018-06-20 09:52:10');
