INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12777', '6282', 'ko', '0', '', '이것은 다중사이트 설치이므로 사용자명이나 이메일을 지정하거나 역할을 설정하여 네트워크에 이미 존재하는 계정을 추가할 수 있습니다. 비밀번호 지정과 같은 추가 옵션은 네트워크 관리자만 가능하며 사용자 프로필을 수정하려면 네트워크 관리자 > 모든 사용자 에서 기존의 사용자명에 마우스를 올리면 나타나는 링크를 사용하세요. ', '0', '', '0', '2018-06-20 09:52:10');
