INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12807', '6312', 'ko', '0', '', '기본적으로 워드프레스는 어떤 분석정보도 수집하지 않습니다. 하지만 많은 웹호스팅 계정은 일부 익명의 분석 데이터를 수집합니다. 분석 서비스를 제공하는 워드프레스 플러그인을 설치했을 수도 있습니다. 이럴 경우 해당 플러그인의 정보를 여기에 추가하세요.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12808', '6313', 'ko', '0', '', '기본적으로 워드프레스는 방문자에 관한 어떤 개인 데이터도 수집하지 않으며 회원가입한 사용자로부터의 사용자 프로필 화면에 보여지는 데이터만 수집합니다. 하지만 일부 플러그인은 개인 데이터를 수집할 수도 있습니다. 아래에 적절한 정보를 제공해야 합니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12809', '6314', 'ko', '0', '', '기본적으로 워드프레스는 개인 데이터를 누구와도 공유하지 않습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12810', '6315', 'ko', '0', '', '기본적으로 워드프레스는 컨택트 폼을 포함하지 않습니다. 컨택트 폼 플러그인을 사용할 경우 컨택트 폼을 제출할 때 어떤 개인 데이터가 캡쳐되는지 얼마동안 지속되는지 이 하위 영역에 기재하세요. 예를들어 고객 서비스 목적을 위해 일정 기간동안 컨택트 폼 체출을 유지하지만 이를 통해 제출된 정보는 마케팅 목적으로 사용하지 않는다는 것을 기재할 수도 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('12811', '6316', 'ko', '0', '', '기본적으로 새 사용자는 사이트에 사용자로 추가됐다는 것을 인지하도록 이메일을 받게됩니다. 이 이메일에는 비밀번호 초기화 링크도 포함됩니다. 새 사용자에게 환영 이메일을 보내기를 원하지 않으면 체크박스를 체크 해제하면 됩니다.', '0', '', '0', '2018-06-20 09:52:10');
