INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13162', '6667', 'ko', '0', '', '두 사람의 디자이너가 프로젝트를 진행하고 있는데 한 디자이너가 다른 디자이너의 멋진 작업물을 덮어쓰기해버린 경험이 있으신가요? 워드프레스 4.9의 디자인 잠금기능(글 잠금 기능와 유사함)은 어렵게 만든 작업중인 디자인을 보호하며 다른 사람이 변경하거나 지울 수 없게 합니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13163', '6668', 'ko', '0', '', 'WordPress.org의 디렉토리에 있는 모든 플러그인과 테마는 100%% GPL이거나 또는 무료이면서 호환 라이센스를 가지고 있으므로 그곳에서 <a href="%1$s">플러그인</a>과 <a href="%2$s">테마</a>를 찾으실 때 안심하셔도 됩니다. 만약 다른 소스로부터 플러그인이나 테마를 얻었다면, <a href="%3$s">그것이 GPL인지 먼저 그들에게 문의</a> 하세요. 만약 그들이 워드프레스 라이센스를 존중하지 않는다면 그들을 추천하지 않습니다.', '0', '', '0', '2018-06-20 09:52:10');
