INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13241', '6746', 'ko', '0', '', '피드 글의 보기 옵션', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13242', '6747', 'ko', '0', '', '이미지 전용으로 섬네일 아래의 이미지 편집을 클릭해서 자르기, 회전 또는 뒤집기 아이콘과 되돌리기와 다시하기가 포함된 인라인 이미지 편집기를 확장할 수 있습니다. 우측의 상자들은 원본 이미지를 자르는 것보다 이미지의 크기, 자르기, 섬네일 자르기에 대한 다른 방식의 더 많은 옵션을 제공합니다. 더 많은 정보를 얻으려면 해당 상자에서 도움말을 클릭할 수 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13243', '6748', 'ko', '0', '', '더 많은 정보는, <a href="%s">릴리즈 노트</a>를 참조하세요.', '0', '', '0', '2018-06-20 09:52:10');
