INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13245', '6750', 'ko', '0', '', '버전 %s에 대한 더 많은 정보는 워드프레스 소개 화면을 참고하세요:', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13246', '6751', 'ko', '0', '', '대부분의 테마에서 헤더 텍스트는 <a href="%1$s">일반 설정</a> 섹션의 사이트 제목과 태그라인입니다. ', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13247', '6752', 'ko', '0', '', '우리의 웹사이트에 회원가입한 사용자에 대해서 우리는 회원이 자신의 프로필에 제공한 개인정보를 저장합니다. 모든 사용자는 자신의 개인 정보를 언제든(회원이 자신의 사용자명을 변경할 수 없을 때는 제외) 열람하거나 편집, 또는 삭제할 수 있습니다. 웹사이트 관리자도 해당 정보를 보거나 편집할 수 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
