INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13310', '6815', 'ko', '0', '', '안녕하세요 ###USERNAME### 님,\n \n 최근에 사이트에서 \'사이트 삭제\' 링크를 클릭했으며 해당 페이지에서\n 폼을 작성했습니다.\n \n 사이트를 확실히 삭제하려면 아래의 링크를 클릭하세요\n 다시 확인을 위한 질문을 받지 않을 것이며 확실하다면 이 링크를 클릭하기만 하면 됩니다:\n ###URL_DELETE###\n \n 자신의 사이트를 삭제할 경우 나중에\n 이곳에서 다시 사이트를 만드는 것을 고려해주세요! (하지만 현재의 사이트와 사용자명은\n 영원히 제거된다는 것을 기억하세요.)\n \n 사이트를 이용해주셔서 감사합니다,\n 웹마스터\n ###SITE_NAME###', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13311', '6816', 'ko', '0', '', '안녕하세요 ###USERNAME### 님,\n \n 최근에 사이트의 관리자 이메일 주소를 변경하기로\n 요청했습니다.\n \n 이것이 맞을 경우 변경하려면 아래의 링크를 클릭하세요:\n ###ADMIN_URL###\n \n 이 작업을 원하지 않을 경우 무시하고 이 이메일을\n 삭제하세요.\n \n 이 이메일은 ###EMAIL###에게 보내진 것입니다\n \n 안녕히 계세요,\n ###SITENAME###\n ###SITEURL###', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13312', '6817', 'ko', '0', '', '안녕하세요! 사이트 %1$s가 자동으로 워드프레스 %2$s로 업데이트 됐습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13313', '6818', 'ko', '0', '', '안녕하세요,\n\n개인 데이터 내보내기 요청이 완료됐습니다.\n아래의 링크를 클릭해 자신의 개인 데이터를 다운로드할 수 있습니다.\n개인정보 보호를 위해 ###EXPIRATION###에 파일을 자동으로 삭제할 것입니다,\n따라서 그 이전에 다운로드 해주세요.\n\n###LINK###\n\n이 이메일은 ###EMAIL###로 보냈습니다.\n\n안녕히 계세요,\n###SITENAME###\n###SITEURL###', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13314', '6819', 'ko', '0', '', '하지만 개인정보 처리방침이 필요로 하는 정보를 제공하거나 해당 정보를 업데이트하고 정확하게 유지하기 위해서 해당 리소스를 올바르게 사용하는 것은 자신의 책임입니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13315', '6820', 'ko', '0', '', '이해합니다', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13316', '6821', 'ko', '0', '', '영구적으로 내 사이트를 비활성을 하길 원하며 다시 %s을(를) 되돌릴 수 없다는 것을 인식하고 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13317', '6822', 'ko', '0', '', 'ID #%1$s: %2$s', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13318', '6823', 'ko', '0', '', 'ID #%1$s: %2$s <strong>죄송합니다. 이 사용자를 제거할 권한이 없습니다.</strong>', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13319', '6824', 'ko', '0', '', 'ID #%1$s: %2$s <strong>현재 사용자는 삭제되지 않습니다.</strong>', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13320', '6825', 'ko', '0', '', 'Identicon (자동생성)', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13321', '6826', 'ko', '0', '', '만약 미디어 파일이 아직 어떤 글에도 첨부되지 않았다면 컬럼을 통해 볼 수 있으며, 그리고 파일 첨부 클릭을 통해 파일을 첨부할 글을 검색할 수 있는 작은 팝업을 띄울 수 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13322', '6827', 'ko', '0', '', '업데이트가 가능할 경우 툴바와 내비게이션 메뉴에 나타나는 알림을 볼 수 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13323', '6828', 'ko', '0', '', '원하는 경우 워드프레스는 새로운 글에 대해 다양한 자동 경보가 가능합니다. ', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13324', '6829', 'ko', '0', '', '어떠한 이유로 이러한 자동 파일 생성이 작동하지 않는다면 걱정할 필요 없습니다. 환경 설정 파일에 데이터베이스 정보를 입력하기만 하면 됩니다. 또한 %1$s을 텍스트 편집기에 열고 자신의 정보를 입력한 다음 %2$s로 저장하면 됩니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13325', '6830', 'ko', '0', '', '플러그인이 엉뚱하게 동작하여 워드프레스를 사용할 수 없다면, %s 디렉토리에 있는 파일을 지우거나 이름을 변경하면 자동으로 비활성화됩니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13326', '6831', 'ko', '0', '', '만약 필요한 가져오기 도구가 목록에 없다면, <a href="%s">플러그인 디렉토리 검색</a>을 통해 사용가능한 가져오기 도구가 있는지 확인하세요.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13327', '6832', 'ko', '0', '', '링크가 사람을 가리키는 것이라면, 위의 폼을 이용하여 그와의 관계를 정할 수 있습니다. 더 많은 사항을 알고 싶다면 <a href="http://gmpg.org/xfn/">XFN</a>을 알아보시면 됩니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13328', '6833', 'ko', '0', '', '사이트의 루트 디렉토리가 <a href="%1$s">쓰기 가능</a>하다면, 이 작업을 자동으로\n 할 수 있지만 그렇지 못한 상태입니다. %2$s 파일에서 url rewrite 규칙이 있어야 합니다. 사이트의 루트 디렉토리에서 %2$s라는 이름의 새 파일을 만드세요. 입력란을 클릭하고 %3$s을(를) 누르면 모두 선택할 수 있습니다. 그런 다음 이 코드를 %2$s 파일에 붙여넣으세요.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13329', '6834', 'ko', '0', '', '이 플러그인을 직접 편집해야 한다면 파일 관리자를 사용해 새로운 이름의 복사본을 만들고 원본은 보존하세요. 이렇게 하면 뭔가 잘못 됐을 때 작동되는 버전으로 재활성화 할 수 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13330', '6835', 'ko', '0', '', '이미 개인정보 처리방침 페이지가 있다면 아래에서 선택해주세요. 없으면 하나 만드세요.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13331', '6836', 'ko', '0', '', '자신이 규제되는 산업에 속하거나 기타 개인정보 법률의 대상이 된다면 해당 정보를 여기에 표시해야 할 수도 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13332', '6837', 'ko', '0', '', '링크 매니저를 사용하려고 찾는 중이라면 <a href="%s">링크 매니저</a> 플러그인을 설치하세요.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13333', '6838', 'ko', '0', '', '어떻게든 직접 편집하기로 했다면 파일 관리자를 사용해 새로운 이름의 복사본을 만들고 원본은 보존하세요. 이렇게 하면 뭔가 잘못 됐을 때 작동되는 버전으로 재활성화 할 수 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13334', '6839', 'ko', '0', '', '만약 링크를 삭제하면, 영구적으로 제거됩니다. 아직 링크에는 휴지통 기능이 없기 때문입니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13335', '6840', 'ko', '0', '', '증명서가 기억나지 않는다면 웹 호스트에게 연락하세요.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13336', '6841', 'ko', '0', '', '%s 사이트를 더 이상 사용하지 않으려면, 아래의 양식을 사용하여 삭제할 수 있습니다. <strong>내 사이트 영구히 삭제하기</strong>를 클릭하면 링크가 포함된 이메일이 보내집니다. 사이트를 삭제하려면 이 링크를 클릭하세요.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13337', '6842', 'ko', '0', '', '헤더 이미지가 사이트에 표시되기를 원하지 않는다면, 이 페이지의 헤더 이미지 섹션 하단에 있는 &#8220;헤더 이미지 제거하기&#8221; 버튼을 클릭하세요. 나중에 헤더 이미지를 재 활성화하기를 원하면 다른 이미지 옵션중 하나를 선택하고 &#8220;변경사항 저장&#8221; 을 클릭하기만 하면 됩니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13338', '6843', 'ko', '0', '', '만약 자신의 이미지를 업로드하기 싫다면 다음의 멋진 헤더중 하나를 사용하거나 랜덤으로 보여줄 수 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13339', '6844', 'ko', '0', '', '글을 편집하거나 발행하면 추가적인 쿠키가 자신의 웹브라우저에 저장됩니다. 이 쿠키는 비개인적인 데이터를 포함하며 단순히 편집한 글 ID를 지시합니다. 1일 후에 만료됩니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13340', '6845', 'ko', '0', '', '문제가 발생하거나 지원이 필요하면 WordPress.org 지원 포럼의 자원 봉사자들이 도움이 될 수도 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13341', '6846', 'ko', '0', '', 'zip 파일형식의 플러그인을 가지고 있다면 여기서 업로드해서 설치할 수 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13342', '6847', 'ko', '0', '', 'zip 파일형식의 테마를 가지고 있다면 여기서 업로드해서 설치할 수 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13343', '6848', 'ko', '0', '', '계정이 있으면서 이 사이트에 로그인하면 브라우저가 쿠키를 수용하는지 여부를 결정하기 위해 임시 쿠키를 설정합니다. 이 쿠키는 아무런 개인적인 데이터를 포함하지 않으며 브라우저를 닫으면 제거됩니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13344', '6849', 'ko', '0', '', '이 사이트에 계정을 갖고 있거나 댓글을 남길 경우 우리가 가지고 있는 개인 데이터의 내보내기 파일을 요청할 수 있습니다. 여기에는 우리에게 제공한 모든 데이터를 포함합니다. 또한 우리가 가지고 있는 모든 개인 데이터를 제거하도록 요청할 수도 있습니다. 여기에는 관리용, 법률적인 또는 보안 목적으로 보존할 의무가 있는 데이터는 포함하지 않습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13345', '6850', 'ko', '0', '', 'WordPress.org에서 플러그인을 즐겨찾기한 경우 여기서 둘러볼 수 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13346', '6851', 'ko', '0', '', 'WordPress.org에서 테마를 즐겨찾기로 표시했다면 여기서 찾아볼 수 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13347', '6852', 'ko', '0', '', '다른 시스템에 글이나 댓글이 있는 경우, 워드프레스가 이 사이트로 가져올 수 있습니다. 시작하려면, 아래에서 가져오려는 시스템을 선택하세요:', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13348', '6853', 'ko', '0', '', '아직 메뉴를 만들지 않았다면 시작하기 위해서 <strong>&#8217;새 메뉴 생성하기&#8217; 링크를 클릭하세요</strong>', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13349', '6854', 'ko', '0', '', '가능한 것을 알아보려면 플러그인 목록 위의 링크를 사용해 특성 및 인기 플러그인을 둘러볼 수 있습니다. 이 영역은 정기적으로 변동됩니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13350', '6855', 'ko', '0', '', '찾는 것이 무엇인지 알고 있다면 검색이 최선의 길입니다. 검색 화면에는 특정 검색어, 제작자, 또는 태그로 워드프레스 플러그인 저장소를 검색할 수 있는 옵션이 있습니다. 또한 인기 태그를 선택해 저장소를 검색할 수도 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13351', '6856', 'ko', '0', '', '우리 사이트에 댓글을 남기면 이름, 이메일 주소, 웹사이트를 쿠키로 저장할지 결정할 수 있습니다. 이것은 편의를 위한 것으로 다른 댓글을 추가할 때 다시 상세 정보를 입력하지 않아도 되는 것입니다. 이 쿠키는 1년간 지속됩니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13352', '6857', 'ko', '0', '', '댓글을 남길 경우 댓글과 해당 메타데이터는 영구히 보존됩니다. 이것은 댓글에 관련 댓글이 있을 경우 검토중으로 있는 것을 방지하기 위해 인지하고 자동으로 승인하기 위해서 입니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13353', '6858', 'ko', '0', '', '원할 경우 카테고리와 태그에 대해서 URL의 사용자 정의 구조를 입력할 수 있습니다. 예를 들어, <code>맛집</code>이라는 카테고리를 사용할 경우 <code>%s/맛집/미분류/</code>와 같은 카테고리 링크를 만들 수 있습니다. 이를 비워두면 기본이 사용됩니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13354', '6859', 'ko', '0', '', '버전 %s를 재설치 하려면 여기서 할 수 있습니다:', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13355', '6860', 'ko', '0', '', '만일 기본이 아닌 옵션을 선택하면, 구조 태그, 즉 <code>%</code>로 둘러싸인 용어들이 있는 일반 URL이 사용자 정의 구조 필드에도 나타날 것이며 경로는 그곳에서 추가적으로 수정할 수 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13356', '6861', 'ko', '0', '', '또한 우리에게 연락하면, 이러한 문제가 다시는 일어나지 않도록 확실히 하겠습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13357', '6862', 'ko', '0', '', '이 화면이 원하지 않는 것이고 본인의 사이트 화면을 방문하고자 한다면, 여기 귀하를 안내할 몇가지 방법이 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13358', '6863', 'ko', '0', '', '만약 rewrite 규칙 자동 생성을 위해 %s 파일에 쓰기권한을 일시적으로 부여했다면, 규칙이 저장된 후에 권한을 원래의 상태로 변경할 것을 잊지마세요.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13359', '6864', 'ko', '0', '', '만약 %s 파일의 자동 생성을 위해 사이트의 루트 디렉토리에 쓰기권한을 일시적으로 부여했다면, 규칙이 저장된 후에 권한을 원래의 상태로 변경할 것을 잊지마세요.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13360', '6865', 'ko', '0', '', '웹사이트에 이미지를 업로드할 경우 임베드 위치 데이터(EXIF GPS)가 있는 이미지 업로드를 피해야 합니다. 웹사이트 방문자는 웹사이트의 이미지로부터 모든 위치 데이터를 다운로드 및 추출이 가능합니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13361', '6866', 'ko', '0', '', '사이트를 상업적 목적으로 이용하면서 개인 데이터의 복잡한 수집 또는 처리에 관련된다면 이미 의논한 정보외에 다음 정보를 개인정보 처리방침에 명시해야 합니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13362', '6867', 'ko', '0', '', '만약 사이트 방문자들이 스스로 가입할 수 있게 하길 원한다면,  멤버쉽 체크박스에 체크해서 사이트 관리자 이외에도 가입할 수 있게 하세요. 스스로 가입한 사용자이거나 사이트 관리자에 의해 가입된 사용자 모두에 대해서 새로운 사용자들을 위한 기본 사용자 역할을 설정할 수 있습니다. ', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13363', '6868', 'ko', '0', '', '카테고리나 태그를 서로 변환하려면 가져오기 화면에 있는 <a href="%s">카테고리 태그 변환기</a>를 사용하세요.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13364', '6869', 'ko', '0', '', '다른 곳에서 다운로드받은 플러그인을 설치하길 원한다면, 좌측 상단의 업로드를 클릭하세요. .zip 압축파일로 업로드를 할 것인지 묻는 메세지가 나타나며, 업로드한 뒤에는, 새 플러그인을 활성화할 수 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13365', '6870', 'ko', '0', '', '만약 플러그인을 업데이트해도 변경사항이 덮어쓰여지길 원치 않는다면, 자신만의 플러그인을 쓰는 것을 고려해보세요. 플러그인을 수정하는 방법에 대한 정보는 처음부터 직접 작성하거나, 또는 플러그인 구조의 더 나은 이해를 위해서, 아래 링크를 확인하세요.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13366', '6871', 'ko', '0', '', '만약 위젯을 삭제하고 싶지만 나중을 위해 설정을 저장하고 싶다면 비활성화 위젯 영역에 끌어다 놓기만 하면 됩니다. 언제든지 재사용할 수 있습니다. 이것은 위젯영역 수가 적거나 다른 위젯 영역을 가진 테마로 바꿀 때 유용합니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13367', '6872', 'ko', '0', '', '하나의 데이터베이스에서 여러 개의 워드프레스를 설치하여 운영하려면 이것을 변경하세요.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13368', '6873', 'ko', '0', '', '선택할 더 많은 플러그인을 보려면 &#8220;새로 추가&#8221; 버튼을 클릭하면 <a href="%s">워드프레스 플러그인 저장소</a>에서 가져온 플러그인을 둘러보거나 검색할 수 있습니다. 워드프레스 플러그인 저장소의 플러그인은 제3자에 의해 디자인 및 개발됐으며 워드프레스가 사용하는 라이센스와 호환되며 또한 무료입니다!', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13369', '6874', 'ko', '0', '', '선택할 더 많은 테마를 보려면 &#8220;새로추가&#8221; 버튼을 클릭하면 <a href="%s">워드프레스 테마 저장소</a>에서 추가적인 테마를 둘러보거나 검색할 수 있습니다. 워드프레스 테마 저장소의 테마는 제3자에 의해 디자인 및 개발되며 워드프레스가 사용하는 라이센스와 호환됩니다. 그리고 이들은 무료입니다!', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13370', '6875', 'ko', '0', '', '%1$s 파일이 <a href="%2$s">쓰기 가능</a>하다면, 이 작업을 자동으로 할 수 있지만\n 그렇지 못한 상태입니다. %1$s 파일에서 mod_rewrite 규칙이 있어야 합니다. 입력란을 클릭하고 %3$s을(를) 누르면 모두 선택할 수 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13371', '6876', 'ko', '0', '', '%1$s 파일이 <a href="%2$s">쓰기 가능</a>하다면, 이 작업을 자동으로 할 수 있지만 그렇지 못한 상태입니다. %1$s 파일에서 url rewrite 규칙이 있어야 합니다. 입력란을 클릭하고 %3$s을(를) 누르면 모두 선택할 수 있습니다. 그런 다음 %1$s 파일의 %4$s 요소안에 이 규칙을 삽입하세요.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13372', '6877', 'ko', '0', '', '테마에 하나 이상의 헤더 이미지가 있거나 하나 이상의 헤더 이미지를 업로드했다면 워드프레스가 사이트에서 각 페이지에 서로 다른 이미지를 임의로 표시하도록 선택할 수 있습니다. 이 기능을 활성화하려면 업로드된 이미지나 기본 이미지 섹션의 &#8220;랜덤&#8221; 라디오 버튼을 클릭하세요.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13373', '6878', 'ko', '0', '', '자신의 웹사이트가 자동화된 의사결정을 포함하고 있다면 - 예를들어 고객으로 하여금 신용거래를 신청하거나 고객의 데이터를 광고 프로필에 수집하거나 할 경우 - 이러한 작업이 발생한다는 것을 주의하고 해당 정보가 어떻게 사용되는지, 해당 수집된 데이터로 어떤 결정이 이뤄지는지, 인위적인 개입 없이 이뤄진 결정에 대해 사용자가 어떤 권리를 가지는지에 대한 정보를 포함해야 합니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13374', '6879', 'ko', '0', '', '자신의 웹사이트가 광고인을 포함한 제 3자로부터 사용자에 관한 데이터를 수집한다면 이 정보는 제 3자 데이터를 처리하는 개인정보 처리방침 영역에 포함해야 합니다.', '0', '', '0', '2018-06-20 09:52:10');
