INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13405', '6910', 'ko', '0', '', '이 사이트가 추구하는 것에 관해 짧게 쓰세요.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13406', '6911', 'ko', '0', '', '어떤 개인 데이터를 수집하는지 목록화 하는 동시에 수집하는 이유도 기재해야 합니다. 이러한 설명에는 데이터 수집과 보존의 법적 기준이면서 사용자가 부여한 능동적인 동의라는 것을 기재해야 합니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13407', '6912', 'ko', '0', '', '마찬가지로 이 항목들은 웹호스트에서 제공됐습니다. 이 정보가 없다면 계속하기 전에 웹호스트에 연락해야합니다. 모든 것이 준비되면&hellip;', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13408', '6913', 'ko', '0', '', '대부분의 경우 워드프레스는 관리 및 보안 업데이트를 보이지 않게 자동으로 적용합니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13409', '6914', 'ko', '0', '', '워드 프레스의 이전 버전에서는 모든 가져오기는 내장되어 있었으나, 대부분의 사람들이 한 번 또는 드물게 그것을 사용하기에 플러그인으로 바뀌었습니다.', '0', '', '0', '2018-06-20 09:52:10');
