INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13411', '6916', 'ko', '0', '', '%s 에 올라온 댓글', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13412', '6917', 'ko', '0', '', '%s에 올라온 응답:', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13413', '6918', 'ko', '0', '', '<strong>글쓴이</strong> 열에서는 글쓴이의 이름, 이메일 주소 및 블로그 URL뿐만 아니라, 댓글 IP 주소도 표시됩니다. 이 링크를 클릭하면 이 IP 주소에서 달린 모든 댓글을 보여줍니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13414', '6919', 'ko', '0', '', '<strong>댓글</strong> 열에서 댓글에 마우스를 올리면 해당 댓글을 승인, 응답(및 승인), 빠른 편집, 편집, 스팸 표시 또는 휴지통으로 보내기 할 수 있는 옵션이 나타납니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13415', '6920', 'ko', '0', '', '<strong>댓글이 달린 글</strong> 열에는 3가지 요소가 있습니다. 텍스트는 댓글을 쓰게 한 글의 이름이며 링크는 해당 글의 편집기로 이동합니다. 글 보기 링크는 현재 사이트의 해당 글로 이동합니다. 숫자가 있는 말풍선은 글이 받은 승인된 댓글의 숫자를 보여줍니다. 대기중인 댓글이 있다면 빨간 말풍선을 이용하여 대기중인 댓글 수를 알 수 있습니다. 말풍선을 클릭하면 해당 글에 있는 댓글만 보여주는 화면으로 이동합니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13416', '6921', 'ko', '0', '', '<strong>제출일자</strong> 열에서 사이트에 제출된 댓글의 날짜와 시간이 나타납니다. 날짜/시간을 클릭하면 해당 댓글이 있는 사이트로 이동합니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13417', '6922', 'ko', '0', '', '이 페이지의 헤더 글자 섹션에서는 이 글자를 표시하거나 감추기를 선택할 수 있습니다. 또한 색상 선택 버튼을 클릭하거나 적격한 HTML 16진수 값, 예: 빨간색일 경우 &#8220;#ff0000&#8221; 을 입력해서 배경 색상을 선택할 수도 있습니다. 또는 컬러피커를 사용해서 색상을 선택할 수도 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13418', '6923', 'ko', '0', '', '이 영역에서는 개인 데이터를 웹사이트에서 얼마 동안 수집하고 처리되는지 설명해야 합니다. 각 데이터셋을 얼마 동안 보존할지, 보존하는 이유에 관한 스케쥴을 마련하는 것은 관리자의 책임이며 해당 정보는 여기에 목록화돼야 합니다. 예를들면 컨택트 폼 목록을 6개월간, 분석 기록을 1년간, 구매 기록을 10년간 보존한다는 것을 언급할 수도 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13419', '6924', 'ko', '0', '', '이 영역에서는 사용자의 데이터를 보호하기 위해 어떤 조치를 하는지 설명해야 합니다. 여기에는 암호화와 같은 기술적인 조치, 이중 인증과 같은 보안 조치, 데이터 보호를 위한 직원교육과 같은 조치가 포함됩니다. 개인정보영향평가를 실행한 적이 있다면 여기에 언급할 수 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13420', '6925', 'ko', '0', '', '이 영역에서는 잠재적이거나 실재적인, 예를들면 내부보고 시스템, 연락 방법 또는 버그 신고보상금 등과 같은, 데이터 위반을 취급하기 위해 어떤 과정이 일어나는지 설명해야 합니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13421', '6926', 'ko', '0', '', '이 영역에서는 사용자가 자신의 데이터에 대해 어떤 권리를 갖고 있는지, 자신의 권리를 주장할 수 있는 방법에 대해 설명해야 합니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13422', '6927', 'ko', '0', '', '이 영역에서는 유럽연합 외부로 사이트 데이터의 모든 이전을 목록화하고 해당 데이터가 유럽 데이터 보호 표준에 보호되는 수단을 설명해야 합니다. 여기에는 웹호스팅, 클라우드 저장장치, 또는 다른 제 3자 서비스를 포함합니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13423', '6928', 'ko', '0', '', '이 영역에서는 자신이 사이트 데이터를 공유하는 모든 제 3자 제공자 이름을 목록화해야 합니다. 여기에는 파트너, 클라우드 기반 서비스, 지불 처리, 제 3자 서비스 제공자 등을 포함합니다. 그리고 공유하는 데이터와 이유를 명기해야 합니다. 가능할 경우 이들의 개인정보 처리방침 링크를 제공하세요.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13424', '6929', 'ko', '0', '', '이 영역에서는 사용자와 사이트 방문자로부터 수집하는 개인 데이터가 무엇인지 기재해야 합니다. 여기에는 이름, 이메일 주소, 개인적인 계정 취향와 같은 개인 데이터와 구매정보와 같은 거래 데이터, 쿠키에 관한 정보와 같은 기술적 데이터가 포함될 수 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13425', '6930', 'ko', '0', '', '이 영역에서는 사이트 URL뿐만아니라 회사 이름, 조직 또는 구성 개인, 일부 정확한 연락정보를 기재해야 합니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13426', '6931', 'ko', '0', '', '이 영역에서는 개인정보와 관련된 내용을 위한 연락 방법을 제공해야 합니다. 데이터 보호 관리자가 필요할 경우 이들의 이름과 전체 연락 상세도 목록화 하세요.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13427', '6932', 'ko', '0', '', '이 하위 영역에서는 웹사이트가 사용하는 쿠키를 목록화해야 합니다. 여기에는 플러그인, 소셜 미디어, 분석에 의한 설정도 포함합니다. 워드프레스가 기본으로 설치하는 쿠키를 제공합니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13428', '6933', 'ko', '0', '', '이 하위 영역에서는 사용하는 분석 패키지가 무엇인지, 사용자가 분석 추적을 제외할 수 있는지, 분석 제공자의 개인정보 처리방침에 대한 링크(있을 경우)를 기재해야 합니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13429', '6934', 'ko', '0', '', '이 하위 영역에서는 댓글을 통해 캡쳐되는 정보가 무엇인지 기재해야 합니다. 우리는 워드프레스가 기본적으로 수집하는 데이터를 기재하고 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13430', '6935', 'ko', '0', '', '이 하위 영역에서는 미디어 파일을 업로드 할 수 있는 사용자에 의해 노출될 수도 있는 정보가 무엇인지 기재해야 합니다. 모든 업로드된 파일은 통상 공개적으로 접근 가능합니다.', '0', '', '0', '2018-06-20 09:52:10');
