INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('13802', '7307', 'ko', '0', '', '플러그인은 사용자 정의 기능을 확장하기 위해 워드프레스에 추가됩니다. 플러그인은 세계 수천명의 개발자에 의해 워드프레스 코어 프로그램으로부터 독립적으로 개발됩니다. <a href="%s">워드프레스 플러그인 저장소</a>에 있는 모든 플러그인은 워드프레스가 사용하는 라이센스와 호환됩니다.', '0', '', '0', '2018-06-20 09:52:10');
