INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14174', '7679', 'ko', '0', '', '%s 스타일시트가 유효한 테마 헤더를 포함하고 있지 않습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14175', '7680', 'ko', '0', '', '%s 테이블은 이미 최적화되있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14176', '7681', 'ko', '0', '', '%s 테이블은 괜찮습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14177', '7682', 'ko', '0', '', '&#8220;슬러그(slug)&#8221; 는 이름의 URL-친화적인 버전이며 모두 소문자로 이루어져 있으며 글자, 숫자와 하이픈으로 이뤄져 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14178', '7683', 'ko', '0', '', '사이트 <a href="https://codex.wordpress.org/Glossary#Character_set">글자 인코딩</a> (UTF-8 추천)', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14179', '7684', 'ko', '0', '', '사용할 수 있는 위젯 섹션에는 선택할 수 있는 모든 위젯들이 포함되어 있습니다. 사이드바로 위젯을 끌면 위젯영역이 펼쳐져서 설정을 구성할 수 있게 해줍니다. 위젯 설정이 마음에 든다면 저장 버튼을 누르면 위젯이 사이트에 표시됩니다. 만약 삭제 버튼을 누르면 위젯이 삭제됩니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14180', '7685', 'ko', '0', '', '이 화면의 카테고리와 태그 변환기 링크는 가져오기 화면으로 이동합니다. 그곳에서 변환기는 설치할 수 있는 하나의 플러그인입니다. 플러그인 설치후 플러그인 활성화 &amp; 가져오기 실행 링크를 클릭하면 태그를 카테고리로 또는 그 반대로 변환하기를 선택할 수 있는 화면으로 갑니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14181', '7686', 'ko', '0', '', '사용자 정의하기에서 사이트를 공개하기 전에 변경사항을 미리보기 할 수 있습니다. 미리보기 화면에서 사이트의 다른 페이지로 내비게이션 할 수도 있습니다. 일부 편집 가능한 요소는 편집 아이콘을 볼 수 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14182', '7687', 'ko', '0', '', '편집기 아래의 문서 메뉴는 플러그인 파일에서 인식한 PHP 함수 목록입니다. 보기를 클릭하면 해당 함수에 관한 웹페이지로 이동합니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14183', '7688', 'ko', '0', '', '새로운 갤러리 위젯', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14184', '7689', 'ko', '0', '', '선택 항목 필드는 보관물 URL에 나타나는 &#8220;카테고리&#8221; 와 &#8220;태그&#8221; 기본명을 정할 수 있게 해줍니다. 예를 들어, &#8220;미분류&#8221; 카테고리에 있는 모든 글을 나열하는 페이지는 <code>/category/uncategorized</code> 대신에 <code>/topics/uncategorized</code>가 될 수 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14185', '7690', 'ko', '0', '', '텍스트 모드는 글 텍스트와 함께 HTML을 입력할 수 있습니다. &lt;p&gt; 태그와 &lt;br&gt; 태그는  텍스트 편집기로 전환되면 줄바꿈으로 변환되며 이것은 글을 깨끗하게 하기 위함입니다. 글자를 입력할 때 한번의 줄바꿈은 &lt;br&gt; 태그를 입력하는 것과 같습니다. 두 번의 줄바꿈은 &lt;p&gt; 태그를 입력한 것과 같습니다. 줄바꿈은 다시 자동으로 태그로 변환됩니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14186', '7691', 'ko', '0', '', '테마 설치 화면은 자바스크립트가 필수입니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14187', '7692', 'ko', '0', '', '%s로 명명된 워커 클래스가 존재하지 않습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14188', '7693', 'ko', '0', '', '워드프레스 팀', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14189', '7694', 'ko', '0', '', '워드프레스 URL과 사이트 URL 은 같거나 (example.com) 또는 다를 수 있습니다; 예를 들어, 워드프레스 코어 파일을 루트 디렉토리에 두지 않고 하위 디렉토리에 둘 수 있습니다(example.com/wordpress).', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14190', '7695', 'ko', '0', '', '워드프레스 팀은 도움을 주고 싶어합니다. 이 이메일을 %s로 전달하면 사이트가 확실히 작동할 수 있도록 팀이 작업해드릴 것입니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14191', '7696', 'ko', '0', '', '사용중인 테마는 망가졌습니다. 기본 테마로 돌아갑니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14192', '7697', 'ko', '0', '', '보여줘야 할 정보의 양은 지역 또는 국가의 비지니스 법규에 따라 다릅니다. 예를들면 물리적 주소, 등록된 주소 또는 사업자 등록번호를 표시해야 할 수도 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14193', '7698', 'ko', '0', '', '종횡비는 폭과 높이의 비율입니다. 선택의 크기를 조정할 때 Shift 키를 누르면 종횡비를 유지할 수 있습니다. 종횡비를 특정하려면 입력상자를 사용하세요. 예: 1:1 (square), 4:3, 16:9, 등.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14194', '7699', 'ko', '0', '', '브라우저에서 이 글의 백업은 아래의 버전과 차이가 납니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14195', '7700', 'ko', '0', '', '링크명, 웹 주소, 설명의 상자들은 위치가 고정됩니다. 반면에 다른 상자는 끌어놓기로 위치를 변경할 수 있습니다. 또한 화면 옵션 탭에서 사용하지 않는 상자를 숨기거나 상자의 제목 표시줄을 클릭해서 최소화 할 수 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14196', '7701', 'ko', '0', '', '관리자 화면의 상자들은 다음과 같습니다:', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14197', '7702', 'ko', '0', '', '파일(%1$s)의 중복 검사가 예상된 중복 검사 값 (%2$s)과 일치하지 않습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14198', '7703', 'ko', '0', '', '상수 %s는 워드프레스 설치 시 정의될 수 없습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14199', '7704', 'ko', '0', '', '현재 테마는 유동 크기 헤더 이미지를 지원하지 않습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14200', '7705', 'ko', '0', '', '현재 테마는 사용자 정의 헤더 이미지 업로드를 지원하지 않습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14201', '7706', 'ko', '0', '', '현재 사용 중인 테마는 첫 번째 테마로 하이라이트 되어 표시됩니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14202', '7707', 'ko', '0', '', '현재 사용자의 권한은 반드시 사용자 정보를 고칠 수 있어야 합니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14203', '7708', 'ko', '0', '', '현재 선택된 개인정보 처리방침 페이지는 존재하지 않습니다. 새 페이지를 만들거나 선택하세요.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14204', '7709', 'ko', '0', '', '현재 선택된 개인정보 처리방침 페이지는 휴지통에 있습니다. 새로운 개인정보 처리방침 페이지를 만들거나 선택 또는 <a href="%s">현재 페이지를 복구하세요</a>.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14205', '7710', 'ko', '0', '', '업데이트 절차는 시간이 필요합니다. 잠시만 기다려주세요.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14206', '7711', 'ko', '0', '', '설명은 기본적으로는 많이 존재하지는 않지만 일부 테마에서는 보여주기도 합니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14207', '7712', 'ko', '0', '', '공포의 화이트 스크린. 테마와 플러그인 코딩작업 시 피할 수 있습니다. 왜냐하면 워드프레스 4.9가 에러에 대해 경고할 것이기 때문입니다. 잠못이루는 밤이 없어지겠죠.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14208', '7713', 'ko', '0', '', '이 화면의 입력란은 사이트 설정의 몇가지 기본을 결정합니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14209', '7714', 'ko', '0', '', '%1$s 파일이 워드프레스 설치에서 한단계 위에 이미 존재합니다. 이 파일에서 환경설정 항목중 어떤 것이라도 초기화하려면 우선 이것을 삭제하세요. <a href="%2$s">지금 설치하기</a>를 시도할 수도 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14210', '7715', 'ko', '0', '', '%1$s 파일이 이미 존재합니다. 이 파일에서 환경설정 항목중 어떤 것이라도 초기화하려면 우선 이것을 삭제하세요. <a href="%2$s">지금 설치하기</a>를 시도할 수도 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14211', '7716', 'ko', '0', '', '다음 플러그인이 업데이트에 실패했습니다:', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14212', '7717', 'ko', '0', '', '다음 플러그인의 새 버전이 있습니다. 업데이트를 할 플러그인을 확인하시고 "플러그인 업데이트"를 누르세요.', '0', '', '0', '2018-06-20 09:52:10');
