INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14254', '7759', 'ko', '0', '', '미리보기 하고 있는 테마는 완전 상호 작용 형태입니다 &mdash; 테마가 글, 글 보관함, 다른 페이지 템플릿을 어떻게 다루고 있는지 보려면 다른 페이지로 이동해보세요. 테마가 어떤 기능의 미리보기를 지원하는지에 따라 설정은 다를 수 있습니다. 새로운 설정을 승인하고 테마를 한번에 활성화 할 수 있습니다. 메뉴 위에 있는 저장 &amp; 활성화 버튼을 클릭하면 됩니다.', '0', '', '0', '2018-06-20 09:52:10');
