INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14259', '7764', 'ko', '0', '', '이 메시지를 보고 계신다면 사용하는 테마가 위젯을 사용하지 않기 때문입니다. 다시 말해서 수정할 사이드바가 없다는 이야기입니다. 테마를 위젯을 사용할 수 있게 만드는 방법을 원하신다면 <a href="https://codex.wordpress.org/Widgetizing_Themes">이 절차</a>를 따라하세요', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14260', '7765', 'ko', '0', '', '제목 입력란과 글 편집 영역이 크게 자리잡고 있지만, 다른 모든 상자들은 끌어놓기를 사용하여 재조정할 수 있으며, 각 상자의 제목 표시줄을 클릭하여 최소화하거나 확장할 수 있습니다. 화면 옵션 탭을 사용하여 더 많은 상자들을  나타낼 수 있고(요약, 트랙백 전송, 사용자 정의 필드, 토론, 슬러그, 글쓴이) 또는 이 화면을 위한 1개의 또는 2개의 열 레이아웃을 선택할 수 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14261', '7766', 'ko', '0', '', '번역이 최신입니다.', '0', '', '0', '2018-06-20 09:52:10');
