INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14321', '7826', 'ko', '0', '', '이 댓글은 현재 스팸으로 표시되었습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14322', '7827', 'ko', '0', '', '이 댓글은 휴지통에 있습니다. 편집하시려면 휴지통에서 꺼내시기 바랍니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14323', '7828', 'ko', '0', '', '이 데이터는 워드프레스의 일반적인 개선을 위해 사용됩니다. 여기에는 새로운 업데이트를 찾아서 자동으로 설치하는 등 사이트를 보호하는 것이 포함됩니다. 또한 통계를 위해서도 사용됩니다. 예를들면 <a href="%s">WordPress.org 통계페이지</a>에서 볼 수 있는 것들입니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14324', '7829', 'ko', '0', '', '<a href="%s">게시되지 않은 개인화변경사항</a>. 편집할 수 있지만, 지금 게시할 필요는 없습니다. 이 사항들은 자동으로 게시될 것입니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14325', '7830', 'ko', '0', '', '파일이 너무 큽니다. 파일은 %1$s KB 보다 작아야 합니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14326', '7831', 'ko', '0', '', '워드프레스 확장 RSS 또는 WXR이라고 불리는 이 형식은 블로그의 글, 페이지, 댓글, 사용자 필드, 카테고리와 태그를 포함합니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14327', '7832', 'ko', '0', '', '이 가져오기는 설치돼 있지 않습니다. <a href="%s">메인 사이트</a>에서 가져오기를 설치하세요.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14328', '7833', 'ko', '0', '', '이것은 %s의 자식 테마입니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14329', '7834', 'ko', '0', '', '이것은 현재 부모 테마에 있는 파일입니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14330', '7835', 'ko', '0', '', '이것은 예제 페이지입니다. 이것은 한곳을 차지하고 사이트 내비게이션에 표시되기 때문에 블로그 글과는 다릅니다(대부분의 테마). 대다수의 사람들은 잠재적인 사이트 방문자들에게 자신을 소개하기 위한 "사이트 소개" 페이지부터 시작합니다. 다음과 같이 작성할 수 있습니다:\n\n<blockquote>안녕하세요! 저는 낮에는 자전거로 배달하는 일을 하고 밤에는 배우가 되기 위한 연기 연습을 합니다. 여기는 제 웹사이트입니다. 서울에 살고 순돌이라는 이름의 대단한 개가 있으며 피냐 콜라다를 좋아합니다.(비 맞기도 좋아합니다.)</blockquote>\n\n...또는 이럴 수도 있습니다:\n\n<blockquote>가나다 회사는 2012년에 만들어졌으며 그 후로 소비자를 위해 품질 좋은 생산품을 만들고 있습니다. 고양시에 위치하며 2천명의 직원이 있고 고양시 커뮤니티를 위해 다양하고 멋진 일을 하고 있습니다.</blockquote>\n\n새로운 워드프레스 사용자로써, <a href="%s">자신의 관리자 화면</a>으로 가서 이 페이지를 삭제하고 자신의 콘텐츠로 채워진 새로운 페이지를 만들어보세요. 즐기세요!', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14331', '7836', 'ko', '0', '', '이것은 단순한 플러그인이 아닙니다. 이것은 루이 암스트롱이 불러 아주 유명한 Hello, Dolly의 두가지 단어에 함축된 전 세대를 아우르는 희망과 열정을 상징화합니다. 활성화되면 페이지가 바뀔 때마다 관리자 화면의 우측 상단에서 임의로 나타나는 <cite>Hello, Dolly</cite>의 가사를 볼 수 있습니다. ', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14332', '7837', 'ko', '0', '', '이 아이템은 이미 삭제됐습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14333', '7838', 'ko', '0', '', '이 타언어 버전은 번역된 언어와 그 국적에 맞게 고쳐져 있습니다. 만약 현재 번역을 원하신다면 업그레이드를 건너뛰셔도 됩니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14334', '7839', 'ko', '0', '', '이것은 사이트가 오프라인이거나 망가진 것임을 의미합니다. 당황하지 마세요. 고칠 수 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
