INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14339', '7844', 'ko', '0', '', '이 화면은 기본 고유주소 구조를 선택할 수 있게 해줍니다. 일반 설정에서 선택하거나 사용자 정의 URL 구조를 만들 수 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14340', '7845', 'ko', '0', '', '이 화면에서 미디어 라이브러리 내의 파일에 메타 데이터를위한 다섯 가지 필드를 편집할 수 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14341', '7846', 'ko', '0', '', '이 화면은 미디어 라이브러리에 있는 파일의 메타데이터에 대해 4가지를 편집할 수 있도록 허용합니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14342', '7847', 'ko', '0', '', '이 화면은 컨텐츠의 표시에 영향을 주는 설정을 포함하고 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14343', '7848', 'ko', '0', '', '이 화면은 테마에서 정의된 위치에 메뉴를 사이트 전체적으로 배정하는데 사용됩니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14344', '7849', 'ko', '0', '', '이 화면은 콘텐츠 리비전을 관리하는데 사용됩니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14345', '7850', 'ko', '0', '', '이 화면은 설치한 테마를 관리하는데 사용됩니다. 워드프레스 설치에 포함된 기본 테마를 제외한 테마들은 제 3자가 디자인하고 개발했습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14346', '7851', 'ko', '0', '', '이 화면은 내비게이션 메뉴를 관리하는데 사용됩니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14347', '7852', 'ko', '0', '', '이 화면은 테마에서 헤더 섹션을 사용자 정의하기 위해 사용됩니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14348', '7853', 'ko', '0', '', '이 화면은 사이트의 모든 사용자들을 나열합니다. 각 사용자는 다음의 5가지 역할 가운데 관리자가 설정한 역할로 정의됩니다: 사이트 관리자, 편집자, 글쓴이, 참여자, 구독자. 관리자 이외의 역할을 가진 사용자들은 로그인했을때 그들의 역할에 맞게 적은 옵션이 보입니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14349', '7854', 'ko', '0', '', '이 화면은 블로깅/콘텐츠 관리 플랫폼에서 데이터를 가져오기 위한 플러그인에 대한 링크를 나열합니다. 가져오려는 플랫폼을 선택하고 팝업 창에서 물으면 지금 설치를 클릭하세요. 만약 플랫폼이 목록에 없는 경우, 플랫폼을 위한 가져오기 플러그인이 있는지 링크를 클릭해서 플러그인 디렉토리를 검색하세요.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14350', '7855', 'ko', '0', '', '이 화면은 모든 글에 대한 접근을 제공합니다. 작업 흐름에 맞게 이 화면의 표시를 사용자 정의 할 수 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14351', '7856', 'ko', '0', '', '이 화면은 글/페이지의 댓글과 링크를 관리하거나 나타나도록 제어하는 많은 옵션이 있습니다. 실제로 아주 많아서 이곳에 모두 수용하지 못합니다! :) 각 토론 설정에 관해서 정보를 얻으려면 문서 링크를 사용하세요.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14352', '7857', 'ko', '0', '', '이 화면은 이 네트워크에 있는 모든 개별 사용자의 사이트를 보여줍니다. 또한 해당 사용자로 하여금 주 사이트를 설정할 수 있도록 합니다. 사용자는 각 사이트의 아래에 있는 링크를 이용해서 사이트 전면이나 알림판으로 갈 수 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14353', '7858', 'ko', '0', '', '이 사이드바는 더이상 사용 가능하지 않으며 사이트의 어떤 곳에도 나타나지 않습니다. 아래의  개별 위젯을 제거해 이 비활성 사이드바를 완전히 제거하세요.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14354', '7859', 'ko', '0', '', '이 사이트는 향후 베타 버전의 업데이트를 자동으로 설치하도록 설정돼있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14355', '7860', 'ko', '0', '', '이 텍스트 템플릿은 웹사이트의 개인정보 처리방침을 만드는데 도움이 될 것입니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14356', '7861', 'ko', '0', '', '이 테마는 아직 평가되지 않았습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14357', '7862', 'ko', '0', '', '이 테마는 이미 설치됐으며 최신입니다.', '0', '', '0', '2018-06-20 09:52:10');
