INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14367', '7872', 'ko', '0', '', '이것은 모든 글, 페이지, 댓글, 사용자정의 필드, 카테고리 및 태그, 내비게이션 메뉴와 사용자 정의 글을 포함합니다.', '0', '', '0', '2018-06-20 09:52:10');
