INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14378', '7883', 'ko', '0', '', '위젯을 활성화 하려면 사이드바로 끌어놓기 하거나 클릭하세요. 위젯을 비활성화 하고 설정을 제거하려면 원위치로 끌어놓으세요.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14379', '7884', 'ko', '0', '', '사용자 정의 링크를 추가하려면, <strong>사용자 정의 링크 섹션을 확장하고 URL과 링크 텍스트를 입력한 다음 메뉴에 추가를 클릭하세요</strong>', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14380', '7885', 'ko', '0', '', '기존 메뉴를 배정하는 대신에 새 메뉴를 추가하려면, <strong>&#8217;새 메뉴 사용하기&#8217; 링크를 클릭하세요</strong>. 새 메뉴가 자동으로 해당 테마 위치에 배정됩니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14381', '7886', 'ko', '0', '', '사이트에 새로운 사용자를 추가하려면, 화면 상단의 새로 추가 버튼을 클릭하거나 사용자 메뉴 섹션에서 새로 추가를 클릭하세요.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14382', '7887', 'ko', '0', '', '사이트에 새로운 사용자를 추가하려면, 이 화면의 폼을 적고 하단의 새로운 사용자 추가 버튼을 클릭하세요.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14383', '7888', 'ko', '0', '', '데이터베이스를 자동으로 수리하여 이 페이지를 사용할 수 있도록 하려면 %s 파일에 다음의 내용을 추가하세요. config에 추가한 후, 이 페이지를 새로고침하세요.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14384', '7889', 'ko', '0', '', '하나 이상의 테마 위치에 메뉴를 배정하려면 <strong>각 위치의 드롭다운에서 메뉴를 선택하세요</strong>. 완료되면 <strong>변경 저장하기를 클릭하세요</strong>', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14385', '7890', 'ko', '0', '', '이미지를 자르려면, 선택하기 위해 클릭하고 드래그하세요.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14386', '7891', 'ko', '0', '', '미디어 아이템을 삭제 하려면 화면 상단의 일괄 선택 버튼을 클릭하세요. 삭제를 원하는 아이템을 선택한 다음 선택 삭제 버튼을 클릭하세요. 선택 취소 버튼을 클릭하면 미디어 보기로 돌아갑니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14387', '7892', 'ko', '0', '', '테마 위치에 현재 배정된 메뉴를 편집하려면, <strong>옆에 있는 &#8217;편집&#8217; 링크를 클릭하세요</strong>', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14388', '7893', 'ko', '0', '', '기존의 메뉴를 편집하려면 <strong>드롭다운에서 메뉴를 선택하고 클릭하세요</strong>', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14389', '7894', 'ko', '0', '', '사이트의 컨텐트를 미리보고 테마 옵션을 사용자 정의 하려면 좌측 상단 창의 설치 버튼을 클릭하세요. 테마 파일이 웹사이트에 자동으로 다운로드 됩니다. 완료되면 테마 활성화가 가능합니다. 활성화 링크를 클릭하거나 테마 관리 화면을 둘러보려면 설치된 테마의 섬네일 이미지 아래에 있는 "실시간 미리보기" 링크를 클릭하세요.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14390', '7895', 'ko', '0', '', '리비전을 내비게이션 하려면 <strong>슬라이더 핸들을 왼쪽이나 오른쪽으로 끌거나</strong> 또는 <strong>이전, 다음 버튼을 사용하세요</strong>.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14391', '7896', 'ko', '0', '', '요청한 작업을 수행하려면, 워드프레스는 웹 서버에 접속해야 합니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14392', '7897', 'ko', '0', '', '이메일을 이용해서 워드프레스에 글을 쓰려면 POP3 접근이 가능한 비밀 이메일 계정이 필요합니다. 이 주소로 보내진 메일은 바로 글로 저장되므로 이 주소를 다른 사람이 모르게 하는 것이 좋습니다. 워드프레스가 무작위로 만든 3가지 글귀를 써도 됩니다: %1$s, %2$s, %3$s.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14393', '7898', 'ko', '0', '', '메뉴 아이템을 재구성하려면, <strong>마우스로 아이템을 끌어놓기하거나 키보드를 사용하세요</strong>. 메뉴 아이템을 오른쪽으로 약간 끌거나 이동하면 서브메뉴를 만들 수 있습니다', '0', '', '0', '2018-06-20 09:52:10');
