INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14396', '7901', 'ko', '0', '', '배경 이미지를 사용하려면 그냥 업로드 하거나 &#8220;이미지 선택하기&#8221; 버튼을 클릭해서 미디어 라이브러리에 이미 업로드된 이미지를 선택하세요. 화면에 단일 파일 이미지를 보이게 하거나 반복시켜 채울 수 있습니다. 배경 이미지를 고정 시켜서 사이트 콘텐츠가 그 위에서 이동하도록 하거나 같이 스크롤 되도록 할 수 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
