INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14573', '8078', 'ko', '0', '', '필요할 영역을 제안했습니다. 각 영역 아래에서 어떤 정보를 제공해야 할지에 대한 간단한 요약을 볼 수 있습니다. 시작할 때 도움이 될 것입니다. 어떤 영역은 제안된 처리방침, 콘텐츠가 포함되며 어떤 곳은 테마나 플러그인으로 부터 정보를 통해 완성돼야 합니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14574', '8079', 'ko', '0', '', '우리는 개인정보 보호와 투명성을 아주 심각하게 취급합니다. 우리가 수집하는 데이터에 관해 더 알아보려면 <a href="%s">WordPress.org/about/privacy</a>를 방문해주세요.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14575', '8080', 'ko', '0', '', '시도를 했지만 사이트를 자동으로 업데이트 할 수 없습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14576', '8081', 'ko', '0', '', '개인정보 처리방침을 수시로 특히 테마나 플러그인을 설치하거나 업데이트 한 이후에 검토할 것을 제안합니다. 처리방침에 추가할만한 변경사항이나 새로운 제안된 정보가 있을 수도 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14577', '8082', 'ko', '0', '', '만일의 경우를 위해 이 글을 브라우저에 백업할 것입니다.', '0', '', '0', '2018-06-20 09:52:10');
