INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14579', '8084', 'ko', '0', '', '시작을 위해 몇개의 링크를 마련했습니다:', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14580', '8085', 'ko', '0', '', 'CodeMirror라는 새로운 코드 편집 라이브러리를 도입했으며 코어 내부에서 사용할 수 있습니다. CSS나 자바스크립드의 인클루드 필드와 같이 플러그인에서 코드 작성이나\n 편집 경험을 개선하는데 사용할 수 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14581', '8086', 'ko', '0', '', '워드프레스 4.9에서 Customizer JS API의 많은 개선이 있었습니다. 많은 고민거리를 제거하고 PHP API처럼 작업하기 쉽게 만들었습니다. 또한 베이스 콘트롤 템플릿, 날짜/시간 제어, 몇 가지 섹션/패널/글로벌 알림 기능이 있습니다. <a href="%s">전체 목록을 알아보세요.</a>', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14582', '8087', 'ko', '0', '', '웹 주소', '0', '', '0', '2018-06-20 09:52:10');
