INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14585', '8090', 'ko', '0', '', '%s에 오신 것을 환영합니다. 이것은 첫번째 글입니다. 수정하거나 삭제하신 후 블로깅을 시작하세요.', '0', '', '0', '2018-06-20 09:52:10');
