INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14587', '8092', 'ko', '0', '', '워드프레스 %1$s에 오신 것을 환영합니다. "워드프레스 소개" 화면으로 안내될 것입니다. 아닌 경우 <a href="%2$s">여기</a>를 클릭하세요.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14588', '8093', 'ko', '0', '', 'WordPress %s 사용을 환영합니다', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14589', '8094', 'ko', '0', '', '워드프레스에 오신 것을 환영합니다!', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14590', '8095', 'ko', '0', '', '워드프레스&nbsp;%s에 오신 것을 환영합니다', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14591', '8096', 'ko', '0', '', '워드프레스에 오신 것을 환영합니다. 시작하기 전에, 데이터베이스에 몇가지 정보가 필요합니다. 계속 진행 하기 전에 다음의 항목을 아셔야 합니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14592', '8097', 'ko', '0', '', '워드프레스에 오신 것을 환영합니다. 이것은 첫번째 글입니다. 이 글을 고치거나 지운 후에 블로깅을 시작하세요!', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14593', '8098', 'ko', '0', '', '개선된 사용자 정의하기 작업흐름에 오신 것을 환영합니다. 디자인 임시저장, 잠금, 예약, 미리보기 링크가 있으며 이에 더해 코드 구문강조와 에러 점검은 깨끗하고 부드러운 사이트 제작 경험을 보여줄 것입니다. 마지막으로 아주 멋지지는 않지만 훌륭한 갤러리 위젯 및 테마 둘러보기와 테마 변경에서 개선된 점이 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14594', '8099', 'ko', '0', '', '유명한 5분 워드프레스 설치 과정에 오신 것을 환영합니다! 아래에서 정보를 입력만 하면 세계에서 가장 확장성 높고 강력한 개인 출판 플랫폼을 사용하는 길로 들어서게 됩니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14595', '8100', 'ko', '0', '', '워드프레스 알림판에 오신 것을 환영합니다! 이 화면은 사이트에 로그인 했을 때 보여지며 워드프레스의 모든 사이트 관리 기능에 접근하게 해줍니다. 어떤 화면에서든 우측 상단의 도움말 탭을 클릭해서 도움을 얻을 수 있습니다', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14596', '8101', 'ko', '0', '', '새 메뉴를 만드는 단계 때문에 혼란스러운 적이 있나요? 아마도 이제는 없을 겁니다! 더 부드러운 메뉴 생성 과정을 위한 사용자 경험(UX)을 마련했습니다. 새롭게 단장된 가이드가 여러분을 안내할 것입니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14597', '8102', 'ko', '0', '', '새로운 디자인을 저장하지 않고 책상에서 벗어날 일이 있다면 걱정하지 마세요. 돌아왔을 때 워드프레스 4.9는 변경사항을 저장할 것인지 친절하게 물어볼 것입니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14598', '8103', 'ko', '0', '', '사용자 데이터를 통해 작업하는 자동화된 의사결정 그리고/또는 프로파일링 종류', '0', '', '0', '2018-06-20 09:52:10');
