INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14600', '8105', 'ko', '0', '', '수집하는 개인 데이터 종류 및 수집 이유', '0', '', '0', '2018-06-20 09:52:10');
