INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14607', '8112', 'ko', '0', '', '무슨 생각을 하고 계신가요?', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14608', '8113', 'ko', '0', '', '카테고리와 태그의 다른점이 뭔가요? 보통 태그는 현재의 글이나 다른 글에서 반복되거나 또는 반복되지 않을 수도 있는 중요한 정보(이름, 주제, 등)를 식별할 수 있게 해주는 임의의 키워드입니다. 반면에 카테고리는 이미 정해진 섹션입니다. 만약 사이트가 책이라고 한다면, 카테고리는 목차와 같고 태그는 색인의 검색어와 같습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14609', '8114', 'ko', '0', '', '댓글의 내용이나 이름, URL, 이메일, IP 주소에 아래 단어가 들어있으면 <a href="edit-comments.php?comment_status=moderated">댓글 검토 목록</a>에 넣습니다. 한 줄에 한 단어나 한 IP 주소를 입력하세요. 단어 안에 있는 것도 검사합니다. 따라서 &#8220;press&#8221;라고 입력하면 &#8220;WordPress&#8221;도 검토해야되는 댓글로 처리됩니다', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14610', '8115', 'ko', '0', '', '댓글의 내용이나 이름, URL, 이메일, IP 주소에 아래 단어가 들어있으면 휴지통으로 처리됩니다. 한 줄에 한 단어나 한 IP를 입력하세요. 단어 안에 있는 것도 검사합니다. 따라서 &#8220;press&#8221;라고 입력하면 &#8220;WordPress&#8221;도 휴지통으로 처리됩니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14611', '8116', 'ko', '0', '', '이 화면에서 새로운 카테고리를 추가할 때 다음의 입력창을 작성하세요:', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14612', '8117', 'ko', '0', '', '이 화면에서 새로운 태그를 추가할 때 다음의 입력창을 작성하세요:', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14613', '8118', 'ko', '0', '', '테마를 변경 했을 때 위젯 영역/사이드바의 수나 설정에 변화가 있을 수 있습니다. 이런 경우 이전 설정과 충돌로 인해서 원활하지 않는 변경이 발생합니다. 테마를 변경했는데 위젯이 안보인다면 이 화면에서 스크롤해서 내리면 비활성화 위젯 영역이 있습니다. 그곳에 모든 위젯과 설정이 저장돼있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14614', '8119', 'ko', '0', '', '작은 모니터에서 미리보기 할 경우 좌측 사아드바 하단의 숨기기 아이콘을 사용할 수 있습니다. 클릭하면 사이드바를 숨기고 사이트에서 새 테마를 미리보기 할 수 있는 영역을 확대합니다. 사이드바 창을 되돌리려면 숨기기 아이콘을 다시 클릭하면 됩니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14615', '8120', 'ko', '0', '', '이 설정이 완료되면, 알림판의 사이트 현황 박스에 &#8220;검색 엔진이 차단됐습니다&#8221; 라는 알림 메시지로 나타나며 사이트가 검색엔진 로봇의 검색 대상이 아니라고 알려줍니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14616', '8121', 'ko', '0', '', '일괄 작업 편집을 사용하여 한번에 선택한 모든 글에 대한 메타 데이터 (카테고리, 글쓴이, 등)를 변경할 수 있습니다. 그룹에서 글을 삭제하려면 나타나는 일괄 편집 영역에서 해당 이름 옆의 X를 클릭합니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14617', '8122', 'ko', '0', '', '방문자가 사이트에서 댓글을 남기면 스팸 감지를 위해 댓글 폼에 보여지는 데이터, 방문자의 IP 주소, 브라우저 사용자 에이전트 스트링을 수집합니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14618', '8123', 'ko', '0', '', '글에 여러 개의 카테고리 또는 태그를 지정하면, 단 하나만 고유주소에 나타납니다: 가장 낮은 번호의 카테고리입니다. 이것은 사용자 정의 구조가 <code>%category%</code>나 <code>%tag%</code>를 포함할 경우 적용됩니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14619', '8124', 'ko', '0', '', '아래 버튼을 누르면, 워드프레스는 컴퓨터에 블로그 내용을 저장하기 위해 XML 파일을 만들 것입니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14620', '8125', 'ko', '0', '', '테마나 플러그인을 직접 수정할 경우 워드프레스 4.9는 이 작업이 위험하다는 것을 친절하게 경고해줍니다. 파일에 저장하기 전에 백업할 것을 권장합니다. 안전한 방법을 선택하세요: 나중에 자신에게 고마워할 것입니다. 팀과 고객도 고마워할 것입니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14621', '8126', 'ko', '0', '', '로그인하면 로그인 정보와 화면 표시 선택을 저장하기 위해 몇 가지 쿠키를 설정합니다. 로그인 쿠키는 이틀간 지속됩니다. 화면 옵션 쿠키는 1년간 지속됩니다. &quot;기억하기&quot;를 선택하면 로그인은 2주 지속됩니다. 계정을 로그아웃하면 로그인 쿠키는 제거됩니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14622', '8127', 'ko', '0', '', '새 글을 발행하면 워드프레스는 자동적으로 아래의 사이트 업데이트 서비스에 알립니다. 이에 대한 더 많은 정보는 Codex에서 <a href="%s">업데이트 서비스</a>를 보세요. 여러 서비스 URL을 넣을 경우에는 한 줄에 하나씩 입력하세요.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14623', '8128', 'ko', '0', '', '테마를 변경하면 위젯은 위치가 변경됩니다. 워드프레스 4.9의 개선된 점은 테마를 변경하더라도 일관된 메뉴와 위젯의 위치를 제공합니다. 추가적으로 설치된 테마를 미리보기 하거나 다운로드와 설치, 새로운 테마를 바로 미리보기 할 수 있습니다. 테마를 사이트에 공개하기 전에 간편하게 미리보기 할 수 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14624', '8129', 'ko', '0', '', '데이터를 보내는 장소', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14625', '8130', 'ko', '0', '', '%1$s 파일을 편집하는 동안, 8개의 키가 유일하게 등록되어 있는지 확인하십시요. <a href="%2$s">WordPress.org 보안 키 서비스</a>를 이용하여 새로 생성할 수 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14626', '8131', 'ko', '0', '', '사이트가 업데이트되는 동안 유지관리 모드가 됩니다. 업데이트가 완료되는대로 사이트가 정상으로 돌아올 것 입니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14627', '8132', 'ko', '0', '', '회사 소개', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14628', '8133', 'ko', '0', '', '데이터를 공유하는 자', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14629', '8134', 'ko', '0', '', '위젯 %s', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14630', '8135', 'ko', '0', '', '위젯은 테마에서 제공된 위젯 영역(보통 사이드바로 불림)에 배치할 수 있는 컨텐츠의 독립된 섹션입니다. 사이드바/위젯 영역을 개별 위젯으로 배치하려면 원하는 영역으로 제목 바를 끌어놓기 하세요. 기본적으로, 첫 번째 위젯 영역만 펼쳐져 있습니다. 다른 위젯 영역에 위젯을 배치하려면, 해당 위젯 영역의 제목 바를 클릭하여 위젯 영역을 펼친후 실행하세요.', '0', '', '0', '2018-06-20 09:52:10');
