INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14646', '8151', 'ko', '0', '', '워드프레스는 데이터베이스를 최적화할 수 있습니다. 이것은 몇가지 상황에서의 퍼포먼스를 향상시킵니다. 데이터베이스의 복구와 최적화는 긴 시간이 걸릴 수 있고 최적화중에는 데이터베이스는 잠깁니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14647', '8152', 'ko', '0', '', '워드프레스는 자동적으로 공통적인 데이터베이스 문제를 찾고 고칠 수 있습니다. 수리는 시간이 걸리니 기다려 주세요.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14648', '8153', 'ko', '0', '', '워드프레스 데이터베이스 수리', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14649', '8154', 'ko', '0', '', '워드프레스는 사람들이 친구와 워드프레스에 대해 이야기하거나 직, 간접적으로 워드프레스를 기반으로 하는 수 많은 비지니스와 서비스들이 사용자들과 그 사실을 공유할 때 성장합니다.  저희는 누군가 좋은 말을 퍼뜨려주는 것에 대해 항상 감사하지만, 단지 <a href="%s">저희의 상표권 가이드라인 확인</a>을 먼저 확인하세요.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14650', '8155', 'ko', '0', '', '워드프레스가 설치됐습니다. 감사합니다. 즐거운 시간을!', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14651', '8156', 'ko', '0', '', '워드프레스가 업데이트되었습니다! 사용하기 이전에 새 버전에 맞는 데이터베이스부터 업그레이드해야 됩니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14652', '8157', 'ko', '0', '', '워드프레스는 세계 각지의 자발적인 개발자들로 구성된 커뮤니티에 의해 만들어진 무료의 오픈 소스 소프트웨어입니다. 워드프레스는 멋진 세계관을 변화시키는 저작권, 즉 GPL이라는 <a href="%s">라이센스</a>의 허가로 제공됩니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14653', '8158', 'ko', '0', '', '워드프레스는 최신 버전입니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14654', '8159', 'ko', '0', '', '워드프레스는 열정적인 각 개인의<a href="%1$s">전세계 팀</a>에 의해 만들어졌습니다. <a href="%2$s">워드프레스에 참여하세요</a>.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14655', '8160', 'ko', '0', '', '워드프레스는 열정적인 개인들로 구성된 전세계 팀에 의해 만들어졌습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14656', '8161', 'ko', '0', '', '사이트의 <a href="%2$s">가시성 설정</a>으로 인해 워드프레스가 <a href="%1$s">업데이트 서비스</a>를 인식할 수 없습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14657', '8162', 'ko', '0', '', '워드프레스는 새로운 방법으로 콘텐츠를 생성하고 제어합니다. 그리고 여러분의 도움을 원합니다. <a href="%s">초기 테스터</a>나 구텐베르그 프로젝트에 참여에 관심이 있으신가요? <a href="%s">깃허브에 기여하기</a>.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14658', '8163', 'ko', '0', '', '워드프레스는 고유주소와 글 보관함에 대해 사용자 정의 URL 구조를 생성할 수 있는 기능을 제공합니다. 사용자 정의 URL 구조는 링크의 아름다움과 사용성, 향후 호환성를 개선할 수 있습니다. <a href="%s">가능한 태그 수</a>, 시작할 수 있는 몇 가지 예는 다음과 같습니다.', '0', '', '0', '2018-06-20 09:52:10');
