INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14675', '8180', 'ko', '0', '', '워드프레스 관리자 화면에서 테마를 직접 편집하려는 것 같습니다. 하지 말 것을 권장합니다. 테마를 직접 편집하면 사이트를 망가트리거나 변경사항이 향후의 업데이트에서 제거될 수도 있습니다. 테마의 CSS를 변경하려면 <a href="%s">자식 테마를 만들 것을</a> 권장합니다.', '0', '', '0', '2018-06-20 09:52:10');
