INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14679', '8184', 'ko', '0', '', '\'%s\' 링크를 삭제하려고 합니다.\n멈추려면 \'취소\'를, 정말 지우려면 \'삭제\'를 누르세요.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14680', '8185', 'ko', '0', '', '이 테마 \'%s\'을(를) 삭제하려고 합니다.\n멈추려면 \'취소\'를, 정말 지우려면 \'삭제\'를 누르세요.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14681', '8186', 'ko', '0', '', '워드프레스 %s를 <strong>영문판으로 설치하려 합니다.</strong> 사용하는 언어가 업데이트시 문제될 수 있습니다. 번역판의 배포를 기다리시는 것도 좋습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14682', '8187', 'ko', '0', '', '댓글을 스팸으로 표시하려고 합니다:', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14683', '8188', 'ko', '0', '', '다음 댓글을 휴지통으로 버리려고 합니다:', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14684', '8189', 'ko', '0', '', '다음 플러그인을 삭제하려고 합니다:', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14685', '8190', 'ko', '0', '', '다음 플러그인을 제거할 예정입니다:', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14686', '8191', 'ko', '0', '', '현재 최근 글을 보여주는 페이지를 편집하고 있습니다', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14687', '8192', 'ko', '0', '', '이제 다른 모든 곳에서 로그아웃 됐습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14688', '8193', 'ko', '0', '', '현재 위치에만 로그인 돼있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14689', '8194', 'ko', '0', '', '현재 개발 버전(%1$s)을(를) 사용 중입니다. 멋지네요! <a href="%2$s">최신 상태를 유지하세요.</a>.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14690', '8195', 'ko', '0', '', '현재 워드프레스 개발 버전을 사용하고 있습니다. 피쳐 플러그인도 현재 개발중입니다. <a href="%s">더 알아보기</a>.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14691', '8196', 'ko', '0', '', '워드프레스 개발 버전을 사용중입니다. 최신 나이틀리 빌드로 자동 업데이트 할 수 있습니다:', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14692', '8197', 'ko', '0', '', '안전하지 않은 브라우저를 사용하고 있습니다!', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14693', '8198', 'ko', '0', '', '웹브라우저의 내장된 파일 업로더를 사용하고 있습니다. 워드프레스 업로더는 다중 파일 선택과 드래그 앤 드랍 기능을 포함하고 있습니다. <a href="#">다중 파일 업로더로 변경하기</a>.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14694', '8199', 'ko', '0', '', '현재 다중 파일 업로더를 사용하고 있습니다. 문제가 있는 경우 <a href="%1$s" target="%2$s">브라우저 업로더</a>를 대신 사용하세요.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14695', '8200', 'ko', '0', '', '귀하는 "%1$s"의 대시보드에 접근을 시도하였습니다. 하지만 현재 이 사이트에 대한 권한이 없습니다. "%1$s" 대시보드에 접근할 수 있다고 확신한다면, 귀하의 네트워크 관리자에게 연락하세요.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14696', '8201', 'ko', '0', '', '존재하지 않는 첨부파일을 편집하려고 합니다. 혹시 지운 것이 아닌가요?', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14697', '8202', 'ko', '0', '', '존재하지 않는 아이템을 편집하려고 합니다. 혹시 지운 것이 아닌가요?', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14698', '8203', 'ko', '0', '', '첨부가 아닌 아이템을 편집하려고 했습니다. 돌아가서 다시 해보세요.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14699', '8204', 'ko', '0', '', '테마는 키워드, 글쓴이 또는 태그로 검색할 수 있으며 특성 필터 목록의 범위로 더욱 특정해 검색할 수 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14700', '8205', 'ko', '0', '', '만약 컴퓨터에 테마를 ZIP 압축파일로 이미 다운받았다면 수동으로 업로드할 수 있습니다. (믿을만하고 원본 소스인지 확인하세요). 또한 구식의 방법인 FTP를 통해 %s 디렉토리로 다운로드받은 테마의 폴더를 복사할 수 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14701', '8206', 'ko', '0', '', '보통 <a href="%s">위젯</a>을 사용해서 여기에서 사이트에 표시될 링크를 추가합니다.  기본으로 예제로써 링크에 몇 개의 워드프레스 커뮤니티 사이트들이 포함되어 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14702', '8207', 'ko', '0', '', '이 화면에서 각 상자에 정보를 입력하여 링크를 추가하거나 편집할 수 있습니다. 링크의 웹 주소와 이름만(사이트에 링크로 표시하길 원하는 텍스트) 필수 필드입니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14703', '8208', 'ko', '0', '', '플러그인 목록 위의 즐겨찾기 링크를 클릭하고 WordPress.org의 사용자명을 입력해 사용자의 즐겨찾는 플러그인을 둘러볼 수도 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14704', '8209', 'ko', '0', '', '색상 선택 버튼을 클릭하거나 적격한 HTML 16진수 값, 예: 빨간색일 경우 &#8220;#ff0000&#8221; 을 입력해서 배경 색상을 선택할 수도 있습니다. 또는 컬러피커를 사용해서 색상을 선택할 수도 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14705', '8210', 'ko', '0', '', '표시할 글의 최대 숫자와 전체 글 또는 요약 글 표시 등과 같이 RSS 피드에서 콘텐츠의 표시를 제어할 수도 있습니다. ', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14706', '8211', 'ko', '0', '', '<a href="%s">끌어오기 북마크</a>로도 글을 생성할 수 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14707', '8212', 'ko', '0', '', '또한 개별 아이템을 삭제할 수 있고 상세 대화 상자에서 편집 화면으로 접근할 수 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14708', '8213', 'ko', '0', '', '또한 한번에 여러 개의 글을 편집하거나 휴지통으로 이동할 수 있습니다.  체크 상자를 사용하여 원하는 글을 선택한 다음 일괄 작업 메뉴에서 원하는 작업을 선택하고 적용을 클릭합니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14709', '8214', 'ko', '0', '', '글/페이지의 컨텐트에 미디어 URL 줄을 붙여넣어서 트위터, 유투브, 플리커 등 많은 인기있는 웹사이트로부터 미디어를 임베드 할 수도 있습니다. <a href="https://codex.wordpress.org/Embeds">임베드 더 알아보기</a>에 대해서는 코덱스를 참고하세요.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14710', '8215', 'ko', '0', '', '이 화면에서 상태 상자를 사용해서 댓글들을 검통할 수도 있으며 댓글의 시간도 변경할 수 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14711', '8216', 'ko', '0', '', '또한 열 위로 마우스를 가져가면 나타나는 작업 링크를 사용하여 필터를 사용한 목록의 축소를 포함한, 동일한 작업의 유형을 수행할 수 있고, 또는 일괄 작업 메뉴를 통해서 여러 페이지에 대한 메타 데이터를 한번에 편집할 수 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14712', '8217', 'ko', '0', '', '<strong>태그</strong>를 사용하여 글에 키워드를 지정할 수 있습니다. 카테고리와는 달리, 태그는 계층 구조가 없기 때문에 각 태그들은 관계가 없습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14713', '8218', 'ko', '0', '', '메뉴 편집기 하단에 있는 <strong>원하는 설정을 선택해서</strong> 개별 메뉴에 테마 위치를 배정할 수 있습니다. 한번에 모든 테마 위치에 메뉴를 배정하려면, 화면 상단에 있는<strong>위치 관리 탭으로 가세요</strong>.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14714', '8219', 'ko', '0', '', '화면 옵션 탭을 사용해서 각 화면당 얼마나 많은 아이탬을 표시할 지와 테이블의 열에 표시/숨김을 할 지를 설정해서 이 화면의 표시를 변경할 수 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14715', '8220', 'ko', '0', '', '비밀번호를 변경할 수 있고, 키보드 단축키를 켤 수 있으며, 워드프레스 관리 화면의 색 구성을 변경할 수 있고, 위지윅(비주얼) 편집기를 끌 수 있습니다. 사이트의 프론트 엔드에서 툴바를 (이전 관리 바라고 불림) 숨길 수 있지만 그것은 관리자 화면에서 비활성화할 수 없습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14716', '8221', 'ko', '0', '', '<a href="%s">Gravatar</a>에서 프로필 사진을 변경할 수 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14717', '8222', 'ko', '0', '', '테마의 기본 헤더 이미지에서 선택할 수 있습니다. 또는 이미지중 하나를 사용하세요. 사이트 제목과 태그라인이 표시되도록 사용자 정의할 수 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14718', '8223', 'ko', '0', '', '이전에 업로드된 헤더 중 하나를 선택하거나, 랜덤으로 하나를 보여줄 수 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14719', '8224', 'ko', '0', '', '사이트의 홈페이지에 표시될 것을 선택할 수 있습니다. 시간의 반대 순으로 글이 표시될 수도 있습니다(전통적인 블로그). 또는 고정적/정적인 페이지가 될 수도 있습니다. 정적인 홈페이지를 설정하려면 두 개의 <a href="%s">페이지</a>를 우선 만들어야 합니다. 하나는 홈페이지가 될 것이고 다른 하나는 글이 표시될 것입니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14720', '8225', 'ko', '0', '', '검색 로봇, 핑 서비스, 스파이더에 의해 사이트가 크롤되는 것을 선택할 수 있습니다. 이들 서비스가 사이트를 무시하기를 원하면 &#8220검색 엔진이 이 사이트 검색 차단하기&#8221; 옆의 체크박스에 클릭하고 화면의 하단에서 변경 사항 저장 버튼을 클릭하세요. 주의할 것은 개인정보는 완벽하지 않다는 것이며 사이트가 웹에서 보여질 수도 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14721', '8226', 'ko', '0', '', '링크 카테고리를 사용하여 링크 그룹을 생성할 수 있습니다. 링크 카테고리 이름은 고유해야 하며 링크 카테고리는 글에 사용하는 카테고리와는 분리됩니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14722', '8227', 'ko', '0', '', '%s 파일을 수동으로 만들고 다음 텍스트를 붙여 넣을 수 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14723', '8228', 'ko', '0', '', '여러 가지 방법으로 화면의 표시 방식을 사용자 정의할 수 있습니다 :', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14724', '8229', 'ko', '0', '', '이 화면의 표시를 화면 옵션 탭과 또는 링크 테이블 위의 드랍다운 필터를 사용해서 사용자 정의할 수 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14725', '8230', 'ko', '0', '', '여러 가지 방법으로 이 화면의 컨텐츠 표시 방식을 사용자 정의할 수 있습니다:', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14726', '8231', 'ko', '0', '', '사용자 정의 배경을 사용해서 테마 코드의 어떤 것도 건드리지 않고 사이트의 모습을 바꿀 수 있습니다. 배경은 이미지나 색상으로 정할 수 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14727', '8232', 'ko', '0', '', '일괄 작업의 풀다운 메뉴에서 링크 카테고리를 삭제할 수 있지만, 그 작업이 카테고리에 있는 링크를 삭제하진 않습니다. 대신 그들을 기본 링크 카테고리로 이동시킵니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14728', '8233', 'ko', '0', '', '썸네일을 유지하면서 이미지를 편집할 수 있습니다. 예를들면 이미지 선택을 표시하는 정사각형 썸네일을 원할 수도 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14729', '8234', 'ko', '0', '', '필요하다면 댓글 좌측에서 정보를 편집할 수 있습니다. 이것은 작성자의 실수를 발견했을 때 유용합니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14730', '8235', 'ko', '0', '', '우측의 아이콘을 사용해서 글쓰기 집중 모드를 활성화 할 수 있습니다. 이 기능은 오래된 브라우저나 작은 화면의 기기에서는 가능하지 않으며 화면 옵션에서 전체 높이 편집기가 활성화 돼있어야 합니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14731', '8236', 'ko', '0', '', '다른 설치나 플랫폼에 가져오기 위해서 사이트의 컨텐츠중 하나의 파일을 내보내기 할 수 있습니다. 파일 내보내기는 WXR이라 불리는 XML 파일 포맷이 됩니다. 글, 페이지, 댓글, 사용자 정의 필드, 카테고리, 그리고 태그가 포함될 수 있습니다. WXR파일이 드랍다운 필터에서 카테고리, 글 작성자, 월별 일자 범위, 또는 발행 상태 별로 내보내기를 제한하여 특정 글이나 페이지를 포함하도록  선택할 수 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14732', '8237', 'ko', '0', '', '글 목록 위의 텍스트 링크를 사용해 글 상태별로 글 목록을 필터링 해 해당 상태의 글만 보여줄 수 있습니다. 기본 보기는 모든 글 보기입니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14733', '8238', 'ko', '0', '', '왼쪽 상단에 있는 텍스트 링크를 이용하여 전부, 관리자, 편집자, 글쓴이, 기여자, 또는 구독자 별로 사용자 역할에 의해 사용자 목록을 필터할 수 있습니다. 기본 보기는 모든 사용자 보기 입니다. 사용하지 않는 사용자 역할은 목록에 없습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14734', '8239', 'ko', '0', '', '사이트에서 추가 테마를 찾으려면 이 화면의 테마 찾기/설치하가를 사용하면 됩니다. <a href="%s">워드프레스 테마 저장소</a>에서 가져와 테마를 표시합니다. 이들 테마는 제3자에 의해 디자인 및 개발됐으며 무료입니다. 또한 워드프레스가 사용하는 라이센스와 호환됩니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14735', '8240', 'ko', '0', '', '자신의 플러그인 영역에 있는 저장소에서 검색하거나 둘러보면서 새 플러그인을 찾아 설치할 수 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14736', '8241', 'ko', '0', '', '필요에 따라 열을 표시/감추기 할 수 있으며 화면 옵션 탭을 사용하여 화면당 나열할 글의 수를 결정할 수 있습니다. ', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14737', '8242', 'ko', '0', '', '필요에 따라 열을 표시/감추기 할 수 있으며 화면 옵션 탭을 사용하여 화면당 나열할 사용자 수를 결정할 수 있습니다. ', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14738', '8243', 'ko', '0', '', '글 편집기 위에 있는 아이콘을 클릭하고 지시에 따라 미디어 파일을 추가할 수 있습니다. 비주얼 모드에서 가능한 인라인 포맷 툴바를 사용해서 이미지를 정렬하거나 편집할 수 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14739', '8244', 'ko', '0', '', '다른 모든 세션에서 로그아웃 버튼을 클릭해 휴대폰이나 공용 컴퓨터와 같은 다른 기기에서 로그아웃 할 수 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14740', '8245', 'ko', '0', '', '글이나 다른 컨텐츠를 관리하는 방법과 유사하게 사이트에 달린 댓글들을 관리할 수 있습니다. 이 화면은 다른 관리 화면과 같은 방법으로 사용자 정의 할 수 있으며 마우스를 올려서 나타나는 작업 링크 또는 일괄 작업을 사용하여 댓글을 관리할 수 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14741', '8246', 'ko', '0', '', '미디어 테이블 위에 있는 드롭다운 메뉴를 이용해 목록을 파일 타입/상태 또는 날짜로 범위를 좁힐 수 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14742', '8247', 'ko', '0', '', '이제는 <a href="%1$s">사용자 정의</a>에서 사용자 정의 배경을 관리하고 실시간 미리보기 할 수 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14743', '8248', 'ko', '0', '', '이제는 <a href="%1$s">사용자 정의</a>에서 사용자 정의 헤더를 관리하고 실시간 미리보기 할 수 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14744', '8249', 'ko', '0', '', '원본 이미지를 비율대로 크기 조정할 수 있습니다. 최상의 품질을 위해 자르기, 뒤집기, 회전하기 전에 크기 조정이 선행돼야 합니다. 이미지는 크기를 줄일 수만 있고 늘릴 수는 없습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14745', '8250', 'ko', '0', '', '글 목록 위에 있는 드롭다운 메뉴를 사용하여 특정 카테고리 또는 특정 월에 있는 글을 표시하는 목록을 수정할 수 있습니다. 선택한 후에 필터 버튼을 클릭합니다. 또한 글 목록에서 글쓴이, 카테고리 또는 태그를 클릭하여 목록을 수정할 수 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14746', '8251', 'ko', '0', '', '사이트 상단에 표시할 이미지를 컴퓨터에서 업로드 하거나 미디어 라이브러리에서 선택할 수 있습니다. 이미지를 선택하고나서 자르기를 할 수 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14747', '8252', 'ko', '0', '', '방문자가 보는 사이트의 언어에 영향을 주지 않고 워드프레스 관리자 화면에 사용할 언어를 선택할 수 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14748', '8253', 'ko', '0', '', '사이트에서 사용자 정의 이미지 헤더를 설정할 수 있습니다. 이미지를 업로드하고 자르기하면 되고 새 헤더가 바로 활성화됩니다. 아니면 &#8220;이미지 선택&#8221; 버튼을 클릭하여 미디어 라이브러리에 이미 업로드된 이미지를 사용할 수도 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14749', '8254', 'ko', '0', '', '작성된 컨텐츠에 삽입되는 이미지의 최대 크기를 설정할 수 있습니다. 또한 이미지를 전체 크기로 삽입할 수 있습니다.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14750', '8255', 'ko', '0', '', '언어를 설정할 수 있으며 번역 파일이 자동으로 다운로드 되고 설치됩니다 (파일 시스템이 쓰기 가능일 경우).', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14751', '8256', 'ko', '0', '', '여전히 사이트를 사용할 수 있지만 생성한 어떤 하위 도메인도 접근하지 못할 수 있습니다. 만약 DNS가 정확한지 알고 있다면,이 메시지를 무시하세요.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14752', '8257', 'ko', '0', '', '컨텐트를 몇가지 다른 방법으로 작성할 수 있습니다; 이 화면은 이러한 모든 방법에 대한 설정을 포함합니다. 상단 섹션은 관리자 화면의 편집기를 관리하며, 나머지는 외부 발행 방식을 관리합니다. 이 방식들에 대한 더 많은 정보를 원하신다면, 문서 링크를 참조하세요.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14753', '8258', 'ko', '0', '', '<a href="https://codex.wordpress.org/Version_%1$s">WordPress %2$s</a>로 자동으로 업데이트 할 수 있습니다 :', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14754', '8259', 'ko', '0', '', '미디어 추가하기 버튼을 클릭해서 미디어(이미지, 오디오, 문서, 등)를 업로드해서 삽입할 수 있습니다. 페이지나 글에 추가하기 위해서 미디어 라이브러리에 업로드된 이미지와 파일을 선택하거나  새로운 미디어를 업로드 할 수 있습니다. 이미지 갤러리를 생성하려면 추가할 이미지들을 선택하고 &#8220;새 갤러리 생성하기&#8221; 버튼을 클릭하세요.', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14755', '8260', 'ko', '0', '', '먼저 글을 생성하지 않고 미디어 파일을 업로드할 수 있습니다. 이것은 나중에 글과 페이지에 업로드 파일을 사용하게 하거나 또는 특정 파일을 공유할 수 있는 웹 링크를 얻을 수 있습니다. 업로드 파일에는 3가지 옵션이 있습니다:', '0', '', '0', '2018-06-20 09:52:10');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('14756', '8261', 'ko', '0', '', '카테고리를 사이트의 섹션 및 그룹 관련 글을 정의하기 위해 사용할 수 있습니다. 기본 카테고리는 <a href="%s">쓰기 설정</a>에서 변경하기 전까지는 &#8220;미분류&#8221; 입니다.', '0', '', '0', '2018-06-20 09:52:10');
